INSERT INTO `oc_news_description` VALUES (1,1,'Pie danish bear claw','Pudding candy apple pie. Pastry toffee soufflé. Halvah icing tart pastry tiramisu gingerbread unerdwear.com.','&lt;p&gt;Pudding candy apple pie. Pastry toffee soufflé. Halvah icing tart pastry tiramisu gingerbread unerdwear.com. Biscuit biscuit ice cream donut sweet dragée sweet muffin jelly-o. Chocolate bar dessert dragée dragée jelly beans biscuit pie candy canes. Jelly-o oat cake danish jelly-o tiramisu candy canes donut. Carrot cake oat cake pie bear claw jujubes. Croissant bear claw topping liquorice gummi bears. Chupa chups pudding wafer candy lollipop carrot cake marshmallow marshmallow toffee. Chocolate halvah pudding wafer. Dragée toffee cheesecake chocolate candy canes candy cookie. Jelly jelly beans cupcake pie.&lt;/p&gt;\r\n',''),(3,1,'Runway Report: : Limkokwing University of Creative Technology Spring/Summer 2013 Collections at Mid Valley','Runway Report: : Limkokwing University of Creative Technology Spring/Summer 2013 Collections at Mid Valley','&lt;p&gt;Lim Kok Wing showcased the talents of their fashion design students during Mid Valley Fashion Week last week. It was a bright, fun, cheery event, packed full of supporting friends of students and designers showcasing that night. The catwalk was light as the student-models walked down the runway to the cheers of their fellow college mates. The designs, though very different from each other, had a uniformed feel to them, which was extremely interesting since they came from different designers.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Full Skirts&lt;/strong&gt;&lt;/p&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwfullskirts.jpg&quot; /&gt;\r\n&lt;p&gt;There was no shortage of full skirts through the show, which made the show feel pretty heavy, leaning toward avant garde, and glamourous instead of being easy and ready-to-wear, though there were one or two exceptions. The student-models did help in lightning the mood though, with their casual walks, and entertaining glamour-shot poses.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Prints&lt;/strong&gt;&lt;/p&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwprint.jpg&quot;/&gt;\r\n&lt;p&gt;Prints on the runway weren’t all just the usual prints, some had a more raw feel it, and looked a little like graffiti or tribal art.&lt;/p&gt;\r\n&lt;p&gt;Cut Outs&lt;/p&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwcutout.jpg&quot; /&gt;\r\n&lt;p&gt;Cut-Out panelling seems to be a trend among fashion students, and I don’t just mean in Lim Kok Wing. There were several looks with cut outs, and geometric shapes that gave a very edgy, futuristic feel to it.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Fish Scales&lt;/strong&gt;&lt;/p&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwscales.jpg&quot; /&gt;\r\n&lt;p&gt;This scaly texture made an appearance during the runway show, and I must say I liked it very much. It was very versatile, giving the garments different feels as the young designers used different prints and sizes of the texture on their garments.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;High-Low Skirts and Tops&lt;/strong&gt;&lt;/p&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwhilo.jpg&quot; /&gt;\r\n&lt;p&gt;This was my favourite trend of the lot. Though some of the skirts were left plain, some high-low skirts were lined with different fabrics, and textures that made me put down my camera just to take a second look.&lt;/p&gt;\r\n&lt;p&gt;Overall, it was an interesting showcase, though I wished they had used professional models on the runway. And since I come from a different fashion college, it was good to be able to be exposed to and see student work and talent that other fashion colleges produce.&lt;/p&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-last.jpg&quot; style=&quot;width: 551px; height: 366px;&quot; /&gt;&lt;/p&gt;\r\n&lt;a href=&quot;http://www.tonguechic.com/fashion/runway-report-lim-kok-wing-springsummer-2013-collections-at-mid-valley/&quot;&gt;Source&lt;/a&gt;\r\n',''),(4,1,'Limkokwing University Launches Its Own Fashion Brand Named Limkokwing Fashion Club','Limkokwing University Launches Its Own Fashion Brand Named Limkokwing Fashion Club','&lt;p&gt;KEE@FSWMAG.COM&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing University, founded by visionary Tan Sri Datuk Seri Dr Lim Kok Wing, launched its own fashion label at Publika on 30 march 2013.&lt;/p&gt;\r\n\r\n&lt;p&gt;The chancellor of Limkokwing University, Her Royal Highness Sultanah Hajjah Kalsom of Pahang graciously attended and was rapturously welcomed by students of Limkokwing University.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8625317550/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8387/8625317550_999f9fa71e_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8625328500/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8543/8625328500_69df85fe43_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624222801/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8102/8624222801_3548349787_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624222217/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8542/8624222217_8677dbc77f_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624220621/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8107/8624220621_0eaf2dda86_c.jpg&quot; /&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://keehuachee.blogspot.com/2013/04/limkokwing-university-launches-its-own.html&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n',''),(2,1,'World’s First University Fashion Label via Limkokwing Fashion Club','Limkokwing University of Creative Technology has introduced the world’s first fashion label created by students for students under the history making Limkokwing Fashion Club.','&lt;p&gt;Limkokwing University of Creative Technology has introduced the world’s first fashion label created by students for students under the history making Limkokwing Fashion Club.&lt;/p&gt;\r\n\r\n&lt;p&gt;The launch took place at Publika, Solaris Dutamas with the presences of Limkokwing University Chancellor DYMM Sultanah of Pahang Sultanah Hajjah Kalsom; alongside YAM Tengku Puteri Seri Lela Wangsa Pahang Tengku Tan Sri Hajjah Meriam and her husband YAB Datuk Seri Mohamed Taufeq Ozair and family; Limkokwing University Founder and President, Professor Emeritus Tan Sri Dato’ Sri Paduka Dr Limkokwing; Chairman of Limkokwing University Council and President of Perbadanan Putrajaya, Tan Sri Aseh; Limkokwing University Vice President and CEO of Centre for Content Creation, Dato Timothy Limkokwing Jr; Limkokwing University Associate Vice President and Fashion Club Creative Director, Dato’ Tiffanee Marie Lim; members of media; students and guests.&lt;/p&gt;\r\n\r\n&lt;p&gt;The grand event kicked off with Limkokwing’s student performances. It was followed by Limkokwing Fashion Club models on the runaway, who are students from 18 countries. Fashion Club Creative Director Dato’ Tiffanee Marie Lim launched the occasion by signing off on the commemoration board. The programme ended with most popular national song of Malaysia, IM4U.&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” said Dato’ Tiffanee, the daughter of Tan Sri Limkokwing.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes that happen to be really practical, fun, and affordable,” added Dato’ Tiffanee.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the age of 21, Dato’ Tiffanee was voted Prestige Magazine’s youngest ever ‘Most Promising Female under 40’. In 2010, she received the ASEAN Master Class Award as the Emerging Women Entrepreneur of the Year. She also organized the first fashion show by an African and Asian University at London Fashion Week in 2012 and moved on to organize shows at Paris, Japan and China. She is a talented and prolific writer, who has already published four books. She also mooted ‘The Magic of Limkokwing’, an award-winning radio programme which she has directed and scripted.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club is a comfy yet glamorous move towards adapting the biggest international trends in the fashion industry with an exciting combination of urban flair and various cultural inspirations for everyone.&lt;/p&gt;\r\n\r\n&lt;p&gt;“I can see that Limkokwing University’s students here are being encouraged to meet the needs of the current generation across the world. The University has totally given the right opportunity for its students to enhance their skills and creativity. Congratulations to the team on their new effort,” said Mr Krishnasamy from Klang, who attended the event during his shopping visit at the mall.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It was an impressive event by the students of Limkokwing University. I’m also very proud of the University’s achievement as being the first university around Asia to create its own fashion brand. The clothes are looking very trendy and attractive,” said Samantha, an international student from Mont Kiara.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club leads innovative designs made with the comfort and well-being of the customer in mind. From studded caps, sequinned and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like T-shirts and hoodies for both genders.&lt;/p&gt;\r\n\r\n&lt;p&gt;Each concept carries the magic and sleek edge of current fashion and reflects what it takes to be a trend setter and style icon of future.&lt;/p&gt;\r\n',''),(6,1,'The World’s First University Fashion Label Launching - Limkokwing Fashion Club','Limkokwing Fashion Club is a brand new fashion label by Limkokwing University of Creative Techonology. This brand is the first label by university in the world and launched in a vast event on 30th March 2013 at Red Zone, Publika, Solaris Dutamas, Kuala Lu','&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Limkokwing Fashion Club is a brand new fashion label by Limkokwing University of Creative Techonology. This brand is the first label by university in the world and launched in a vast event on 30th March 2013 at Red Zone, Publika, Solaris Dutamas, Kuala Lumpur.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://2.bp.blogspot.com/-1LZVdrh34Hk/UVcZpKglA9I/AAAAAAAABFk/nxuPmYdUxF8/s1600/DSCN9065.jpg&quot;&gt;&lt;img src=&quot;http://2.bp.blogspot.com/-1LZVdrh34Hk/UVcZpKglA9I/AAAAAAAABFk/nxuPmYdUxF8/s640/DSCN9065.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Early performance by Limkokwing University student&lt;/span&gt; &lt;a href=&quot;http://2.bp.blogspot.com/-MLITe_DIklQ/UVcZoRBHZ2I/AAAAAAAABFY/6iqh8Q4gt1A/s1600/DSCN9054.jpg&quot;&gt;&lt;img src=&quot;http://2.bp.blogspot.com/-MLITe_DIklQ/UVcZoRBHZ2I/AAAAAAAABFY/6iqh8Q4gt1A/s640/DSCN9054.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;The arrival of Tengku Puteri Seri Lela Wangsa Pahang, Tengku Tan Sri Hajah Meriam Bt Sultan Ahmad Shah Al-Musta\'in Billah and her husband, Dato Seri Mohd Taufik Ozeir and the founder and president of the university;Tan Sri Dato\' Sri Lim Kok Wing&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The event was attended by the inaugural Chancellor of Limkokwing University, DYMM Sultanah Pahang Sultanah Hajjah Kalsom DK, the founder and president of the university;Tan Sri Dato\' Sri Lim Kok Wing, Dato\' Tiffanee Marie Lim as the person behind the Limkokwing Fashion Club label, Yang Amat Mulia Tengku Puteri Seri Lela Wangsa Pahang, Tengku Tan Sri Hajah Meriam Bt Sultan Ahmad Shah Al-Musta\'in Billah and her husband, Dato Seri Mohd Taufik Ozeir and other VIPs.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://3.bp.blogspot.com/-0NNgYBCmDlk/UVcZp-HjccI/AAAAAAAABGE/sl3UzDB-R3E/s1600/DSCN9098.jpg&quot;&gt;&lt;img src=&quot;http://3.bp.blogspot.com/-0NNgYBCmDlk/UVcZp-HjccI/AAAAAAAABGE/sl3UzDB-R3E/s640/DSCN9098.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Tan Sri Dato\' Sri Lim Kok Wing (Left), DYMM Sultanah Pahang Sultanah Hajjah Kalsom DK (Center) &amp;amp; Dato\' Tiffanee Marie Lim (Right)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Below is the fashion show video of the &quot;Limkokwing Fashion Club&quot; catwalk during the event. All models are the student of the university and its proved that the beauty always come with brain.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;480&quot; src=&quot;//www.youtube.com/embed/wZWfkbIUKGc&quot; width=&quot;720&quot;&gt;&lt;/iframe&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;480&quot; src=&quot;//www.youtube.com/embed/STV5ldeZdzk&quot; width=&quot;720&quot;&gt;&lt;/iframe&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This label at the moment available to grab at Limkokwing University before delivered to other 11 campuses of Limkokwing Universities worldwide. The price for this collection is started from RM50 up to few hundred Ringgit and definitely very affordable for students who love to be in trend.&lt;/p&gt;\r\n\r\n&lt;p&gt;Here are more photos from the event.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://4.bp.blogspot.com/-EbWZxGjfing/UVcZp0iI-MI/AAAAAAAABGA/w8uAczFOo28/s1600/DSCN9091.jpg&quot;&gt;&lt;img src=&quot;http://4.bp.blogspot.com/-EbWZxGjfing/UVcZp0iI-MI/AAAAAAAABGA/w8uAczFOo28/s640/DSCN9091.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Tan Sri Dato\' Sri Lim Kok Wing (Left) &amp;amp; DYMM Sultanah Pahang Sultanah Hajjah Kalsom DK (Right)&lt;/span&gt; &lt;a href=&quot;http://3.bp.blogspot.com/-dHnMtxpMFFs/UVcZoU4YcgI/AAAAAAAABFU/XLueyQGogyo/s1600/DSCN9059.jpg&quot;&gt;&lt;img src=&quot;http://3.bp.blogspot.com/-dHnMtxpMFFs/UVcZoU4YcgI/AAAAAAAABFU/XLueyQGogyo/s640/DSCN9059.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;A cute guy with his friend&lt;/span&gt; &lt;a href=&quot;http://1.bp.blogspot.com/-C-WG1BSKLtA/UVcZpGQqmnI/AAAAAAAABFg/LdlgfpBEMCg/s1600/DSCN9067.jpg&quot;&gt;&lt;img src=&quot;http://1.bp.blogspot.com/-C-WG1BSKLtA/UVcZpGQqmnI/AAAAAAAABFg/LdlgfpBEMCg/s640/DSCN9067.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Early performance by Limkokwing University student&lt;/span&gt; &lt;a href=&quot;http://1.bp.blogspot.com/-WhSw1il35K4/UVcZpoH_y7I/AAAAAAAABFw/nYMDmmt1H80/s1600/DSCN9097.jpg&quot;&gt;&lt;img src=&quot;http://1.bp.blogspot.com/-WhSw1il35K4/UVcZpoH_y7I/AAAAAAAABFw/nYMDmmt1H80/s640/DSCN9097.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Tengku Puteri Seri Lela Wangsa Pahang, Tengku Tan Sri Hajah Meriam Bt Sultan Ahmad Shah Al-Musta\'in Billah (Center) and her husband, Dato Seri Mohd Taufik Ozeir (Left) and the founder and president of the university;Tan Sri Dato\' Sri Lim Kok Wing (Right)&lt;/span&gt; &lt;a href=&quot;http://3.bp.blogspot.com/-0NNgYBCmDlk/UVcZp-HjccI/AAAAAAAABF8/UTQB8Y4qUjs/s1600/DSCN9098.jpg&quot;&gt;&lt;img src=&quot;http://3.bp.blogspot.com/-0NNgYBCmDlk/UVcZp-HjccI/AAAAAAAABF8/UTQB8Y4qUjs/s640/DSCN9098.jpg&quot; /&gt;&lt;/a&gt; &lt;span class=&quot;caption&quot;&gt;Tan Sri Dato\' Sri Lim Kok Wing (Left), DYMM Sultanah Pahang Sultanah Hajjah Kalsom DK (Center) and Dato\' Tiffanee Marie Lim (Right)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Get to know the university: &lt;a href=&quot;http://www.limkokwing.net/&quot;&gt;http://www.limkokwing.net&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://microscopasia.blogspot.com/2013/03/the-worlds-first-university-fashion.html&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n',''),(7,1,'Limkokwing debuts world’s first in Fashion at Publika, Solaris Dutamas','All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that? The Limkokwing University of Creative Technology has yet again created a world innovation, another ground breaking step forwar','&lt;p&gt;&lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-001.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that? The Limkokwing University of Creative Technology has yet again created a world innovation, another ground breaking step forward in fashion. Limkokwing Fashion Club is the first of its kind, being the first University to launch its own fashion brand.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club, the new label bursting with energy has ready-to-wear apparel offering an assortment of versatile pieces, is definitely something we’ve got our eye on. Bold and very cool, in the University’s signature black, the brand focuses on urban flare, with practical clothes that can take you from campus, to smart casual, to evening.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club, has just been launched last Saturday 30th April at Publika, Solaris Dutamas. The launch was graced by the presence of her Excellency, DYMM Sultanah Pahang Sultanah Hajjah Kalsom, Professor Emeritus Tan Sri, Dato Sri Dr Limkokwing and special guests as well as the University’s industry guests.&lt;/p&gt;\r\n\r\n&lt;p&gt;The launch of this glamorous brand started with brilliant performances from Sound and Music Academy followed by the grand show which wowed the whole crowd, including the royalties leaving smiles on their faces. Limkokwing Fashion Club, runway show, was the highlight of the day, with 35 models from more than 20 countries, e.g the UK, Mexico, Colombia, Lithuania, Kazakhstan, Iran, Brazil, Venezuela, Ethiopia, Indonesia, China, Malaysia and many more to mesmerize the crowd present. The launch was initiated by Dato’ Tiffanee Marie Lim, Associate Vice President Talent and Brand Development, the young, vibrant woman who made Limkokwing students dreams come true.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-002.jpg&quot; /&gt; &lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-003.jpg&quot; /&gt; &lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-004.jpg&quot; /&gt; &lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-005.jpg&quot; /&gt; &lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-006.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you, and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes, that happen to be really practical, fun, and affordable.”&lt;/p&gt;\r\n\r\n&lt;p&gt;From studded caps, sequined and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like t-shirts and hoodies for both sexes, it seems the stylish crowd may now halt their search.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;https://fashionclub.my/catalog/view/theme/fashion_club/image/media/launch-007.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The brand has plans to be available internationally by the end of the year, no doubt in all the 11 countries the university already has a presence- including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;Named after witnessing the staggering talent found on campus, why not? The global fashion industry is worth billions and the University has already proved its mettle after taking part in runway showcases at London Fashion Week, Paris and Osaka last year alone. This brand is definitely one to watch!&lt;/p&gt;\r\n',''),(8,1,'Limkokwing University debuts a first in fashion','What better place to give you the edge and skills you need to become successful within the international industry other than Limkokwing University?','&lt;p&gt;What better place to give you the edge and skills you need to become successful within the international industry other than Limkokwing University? The arrival of Limkokwing Fashion Club has seen the students of Malaysia’s most globalized university exploring their skill sets of creativity, boldness and high spirit on the brand.&lt;/p&gt;\r\n\r\n&lt;p&gt;With the University making waves at home and abroad, it is hard to miss this dramatic accomplishment in fashion. Having achieved success with their shows in the worlds fashion capitals such as London and Paris, the journey has developed into the first ever retail brand by a University. Even the new store at Publika was designed by graduates at Limkokwing, energized by student photographers, and models showcasing their best efforts in creativity and innovation.&lt;/p&gt;\r\n\r\n&lt;p&gt;It is interesting to shop the collection because it speaks of the students’ ideals and wants through the University’s signature black colour collection which can transition easily between day and night. There you will find youthful styles ranging from sequined and leather fitted jackets, t-shirts and hoodies for both sexes, specially designed handbags, backpacks, and the hip student essentials.&lt;/p&gt;\r\n\r\n&lt;p&gt;It’s good to know our flag is being flown high abroad. “The whole idea is to prove we can run our own brand as students and provide the opportunities they deserve. The world’s first recognition is great, but came along much later and we are happy to innovate for Malaysia,” said Dato’ Tiffanee Marie Lim, Limkokwing University’s AVP for Talent and Brand Development, a graduate herself.&lt;/p&gt;\r\n\r\n&lt;p&gt;Driven by the University’s Faculty of Fashion and Lifestyle Creativity the brand has plans to be available internationally by the end of the year, no doubt in all the 11 countries the university already has a presence- including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;For more information on enrolment and programs on offer visit&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.askcleo.com.my/&quot;&gt;CLEO, October 2013&lt;/a&gt;&lt;/p&gt;\r\n',''),(9,1,'Limkokwing Fashion Club is what you need!','Introducing Limkokwing Fashion Club, a new luxury fashion label specializing in exclusive ready-to-wear apparel offering an assortment of versatile pieces, Limkokwing Fashion Club is a brand to watch out for.','&lt;p&gt;Introducing Limkokwing Fashion Club, a new luxury fashion label specializing in exclusive ready-to-wear apparel offering an assortment of versatile pieces, Limkokwing Fashion Club is a brand to watch out for. One of a kind, Limkokwing Fashion Club is brand created exceptionally by Limkokwing University to meet the wants of its students as well as for all the fashionable people out there. And, Limkokwing Fashion Club would be the world’s first fashion label created by a university.&lt;/p&gt;\r\n\r\n&lt;p&gt;Bold and very cool in the University’s signature black colour, Limkokwing Fashion Club has been inspired by a unique blend of urban flare and contemporary ethnic influences. The result of this venture is a collection of practical and glamorous outfits for students, fit for day or evening.&lt;/p&gt;\r\n\r\n&lt;p&gt;Basic pieces with a twist of men and women’s need and wants, this brand is sure to be a trend setter for the Malaysian market, and soon through the University’s expanding networks to the world. From studded caps, sequinned open jackets, classy blazers, ornate handbags and bag packs to casual and chic T-shirts, this brand has made it a point to have what the most stylish are searching for.&lt;/p&gt;\r\n\r\n&lt;p&gt;This brand has been created and named after witnessing the infinite number of talented students works from Limkokwing University of Creative Technology, and why not? The fashion industry worldwide is worth billions and the University has already created its name in the world of fashion after taking part in runway showcases in fashion capital cities, like London for London Fashion week, Paris and Osaka in 2013 alone. This brand is to further support and promote its students talents in the dynamic fashion industry, the name of the brand itself has been named after fashion club, a club which produces weekly fashion events on campus as well as shoots etc. This store would give the students a chance to create designs right on campus in Cyberjaya, Malaysia, where the first store is located.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club was the vision and dream of Dato’ Tiffanee Marie Lim, (Associate Vice- President, Brand and Talent Development at Limkokwing University) daughter of Malaysia’s most prominent icon of creativity and innovation, Dato’ Tiffanee Marie Lim, has an innate flair for design and she has made it a point to concretize this dream, not only for her but for the creative students.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dato’ Tiffanee Marie Lim was thrilled to announce, “It has been a joy learning how to do this with our students, who I really consider to be my friends. We are privileged to be surrounded by so many talented people!&lt;/p&gt;\r\n\r\n&lt;p&gt;I think at Limkokwing fashion is so inspiring and it’s about time we did this! I have seen with my own eyes how people have responded to the University’s brand personality and I hope that really translates into people identifying with our products.&lt;/p&gt;\r\n\r\n&lt;p&gt;This is the world’s first, meaning a Malaysian Innovation, and we are proud to have been a part of fashion history this way”&lt;/p&gt;\r\n',''),(10,1,'Limkokwing features world’s first in Fashion at Mid Valley Fashion Week','The Limkokwing University of Creative Technology through its world first fashion label , Limkokwing Fashion Club, presented its bold and fresh collection last Friday 12 April at the just ended Mid Valley Mega Mall Fashion week.','&lt;p&gt;The Limkokwing University of Creative Technology through its world first fashion label , Limkokwing Fashion Club, presented its bold and fresh collection last Friday 12 April at the just ended Mid Valley Mega Mall Fashion week.&lt;/p&gt;\r\n\r\n&lt;p&gt;The showcase was graced by His Excellency YBhg Tan Sri Dato’ Seri Dr Aseh Che Mat and Puan Sri Aseh, Limkokwing University Council Chairman and President of Putrajaya Holdings, Dato’ Danny Ooi, founder of The Malaysia Book of Records and Tan Sri, Dato’ Sri Paduka Dr Limkokwing as well as special guests and the University’s industry guests.&lt;/p&gt;\r\n\r\n&lt;p&gt;The presentation of the cool student wear was heralded by a showcase of Limkokwing student’s wealth of creativity through song and dance performances from the Sound and Music and Performance Arts Academies. Every aspect of the show production from performances, music composition, choreography, hair and make-up design alongside with the run way collection were created from concept to execution by the students of Limkokwing University themselves.&lt;/p&gt;\r\n\r\n&lt;p&gt;Thirty-five models from more than 20 countries such as from the United Kingdom, Mexico, Colombia, Lithuania, Kazakhstan, Iran, Brazil, Venezuela, Indonesia, China, Malaysia showcased garments from the Fashion Club Brand collection and Student Award winning design collection.&lt;/p&gt;\r\n\r\n&lt;p&gt;This special showcase included leading retailers Nose, Pepe Jeans, Inglot who sponsored us with their trendy products as well as Sharp, HSBC and Mid Valley Mega Mall with whom lent us their support.&lt;/p&gt;\r\n\r\n&lt;p&gt;The fashion week showcase just came a week after Limkokwing University launched the world’s first ever fashion label to be created by a university which was initiated by Dato’ Tiffanee Marie Lim, Associate Vice President Talent and Brand Development.&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you, and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes, which happen to be really practical, fun, and affordable.”&lt;/p&gt;\r\n\r\n&lt;p&gt;The brand inspired by the international community of Limkokwing students from 156 countries has plans to be available across the world by the end of the year, no doubt in all the 11 countries that the university already has a presence in, -including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n',''),(5,1,'The Limkokwing Fashion Club','All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that?','&lt;p&gt;All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that? The Limkokwing Fashion Club has just been launched last Saturday 30th April at Publika, Solaris Dutamas. The launch was graced by the presence of her Excellency, DYMM Sultanah Pahang Sultanah Hajjah Kalsom, Professor Emeritus Tan Sri, Dato Sri Dr Limkokwing and special guests as well as the University’s industry guests.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club, the new label bursting with energy has ready-to-wear apparel offering an assortment of versatile pieces, is definitely something we’ve got our eye on. From studded caps, sequined and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like t-shirts and hoodies for both sexes, it seems the stylish crowd may now halt their search.&lt;/p&gt;\r\n\r\n&lt;p&gt;The University has already proved its mettle after taking part in runway showcases at London Fashion Week, Paris and Osaka last year alone. The brand also has plans to be available internationally by the end of the year, no doubt in all the 11 countries the university already has a presence- including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;“&lt;em&gt;We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand&lt;/em&gt;,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://lifestyle.malaysia.msn.com/fashion/catwalk-catchup/photoviewer.aspx?cp-documentid=252230529&quot; target=&quot;_blank&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n',''),(11,1,'Fashion Innovation: Limkokwing Fashion Club World’s First Fashion Label Created by a University ','As a kid growing up, you can’t help but dream honestly about what it is that really want of our futures.','&lt;p&gt;By Dato’ Tiffanee Marie Lim&lt;/p&gt;\r\n&lt;p&gt;What is your dream?&lt;/p&gt;\r\n&lt;p&gt;As a kid growing up, you can’t help but dream honestly about what it is that really want of our futures. Most of us have always (either secretly or not so secretly) known what we want to do in life.&lt;/p&gt;\r\n&lt;p&gt;When you dream of being a fashion designer, like I do, now I know, you have no idea what you’re getting yourself into!&lt;/p&gt;\r\n&lt;p&gt;The truth is that it’s even better than you could have imagined, because the feeling of having created something is overwhelming and powerful.&lt;/p&gt;\r\n&lt;p&gt;Fashion is something that literally changes our worlds everyday, sometimes twice a day or more. It is the most extroverted art form, and helps us become the person we want to be. It provides us with confidence and poise, and style, and makes us think about ourselves, how we relate to others, and where we’re going with our time.&lt;/p&gt;\r\n&lt;p&gt;There really is nothing like it. Perhaps music might be the most similar, in the way that it brings people together and inspires.&lt;/p&gt;\r\n&lt;p&gt;Fashion allows us to be the same, and at the same time, completely different because of who we are on the inside. There is nothing better than a shirt or jacket that fits right, that you can depend on wherever you go, and that’s what we wanted to create for people.&lt;/p&gt;\r\n&lt;p&gt;We began to seriously design Limkokwing Fashion Club about the end of last year, and went to find factories to figure out how to do it.&lt;/p&gt;\r\n&lt;p&gt;On campus, we created a Fashion Club, of students who love fashion. Everyone can join. We hold weekly fashion shows, and do photo shoots all the time, and we sit and have conversations about ideas. We talk about what we want, and who we want to speak to, and how to make things fun.&lt;/p&gt;\r\n&lt;p&gt;Our students win awards and have created some amazing collections, so there is so much talent to draw from. Everything around us on campus is designed to support creativity, and the thinking behind naming the label Limkokwing Fashion Club was truly in tribute of our students.&lt;/p&gt;\r\n&lt;p&gt;The whole time, we had no idea what we were doing was to be a world innovation.&lt;/p&gt;\r\n&lt;p&gt;We were given an opportunity to create by the president, Tan Sri Limkokwing, who has the foresight to understand that when people feel supported and encouraged, innovation happens almost as a guarantee. It is through his example that thousands of people such as myself are empowered.&lt;/p&gt;\r\n&lt;p&gt;Now we have shot some beautiful photographs of our students in Fashion Club, and have begun to promote it as best we can. Our students look fantastic in it and have started to respond. We cannot wait to take our project to the countries where Limkokwing already exists, and, to the best retailers and malls in the world. I am certain if we run fast we will be able to achieve that.&lt;/p&gt;\r\n&lt;p&gt;Our students have given us this opportunity and we are grateful to them for their boldness and courage, and we hope the brand reflects that. In character (to me) it is aspirational and vibrant and stylish, with practical clothes and accessories young people everywhere would like- such as basics that fit well in quality materials, flattering fit jackets, and accessories with some spunk.&lt;/p&gt;\r\n&lt;p&gt;As a fashion fan, I couldn’t be more thrilled.&lt;/p&gt;\r\n&lt;p&gt;On to the next innovation!&lt;/p&gt;',''),(12,1,'Limkokwing University debuts a first in fashion','What better place to give you the edge and skills you need to become successful within the international industry other than Limkokwing University? ','&lt;p&gt;What better place to give you the edge and skills you need to become successful within the international industry other than Limkokwing University? The arrival of Limkokwing Fashion Club has seen the students of Malaysia’s most globalized university exploring their skill sets of creativity, boldness and high spirit on the brand.&lt;/p&gt;\r\n\r\n&lt;p&gt;With the University making waves at home and abroad, it is hard to miss this dramatic accomplishment in fashion. Having achieved success with their shows in the worlds fashion capitals such as London and Paris, the journey has developed into the first ever retail brand by a University. Even the new store at Publika was designed by graduates at Limkokwing, energized by student photographers, and models showcasing their best efforts in creativity and innovation.&lt;/p&gt;\r\n\r\n&lt;p&gt;It is interesting to shop the collection because it speaks of the students’ ideals and wants through the University’s signature black colour collection which can transition easily between day and night. There you will find youthful styles ranging from sequined and leather fitted jackets, t-shirts and hoodies for both sexes, specially designed handbags, backpacks, and the hip student essentials.&lt;/p&gt;\r\n\r\n&lt;p&gt;It’s good to know our flag is being flown high abroad. “The whole idea is to prove we can run our own brand as students and provide the opportunities they deserve. The world’s first recognition is great, but came along much later and we are happy to innovate for Malaysia,” said Dato’ Tiffanee Marie Lim, Limkokwing University’s AVP for Talent and Brand Development, a graduate herself.&lt;/p&gt;\r\n','');
