INSERT INTO `oc_pavblog_blog_description` VALUES (14,1,'Runway Report: : Limkokwing University of Creative Technology Spring/Summer 2013 Collections at Mid Valley','&lt;p&gt;Lim Kok Wing showcased the talents of their fashion design students during Mid Valley Fashion Week last week. It was a bright, fun, cheery event, packed full of supporting friends of students and designers showcasing that night.&lt;/p&gt;\r\n','&lt;p&gt;The catwalk was light as the student-models walked down the runway to the cheers of their fellow college mates. The designs, though very different from each other, had a uniformed feel to them, which was extremely interesting since they came from different designers.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Full Skirts&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwfullskirts.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;There was no shortage of full skirts through the show, which made the show feel pretty heavy, leaning toward avant garde, and glamourous instead of being easy and ready-to-wear, though there were one or two exceptions. The student-models did help in lightning the mood though, with their casual walks, and entertaining glamour-shot poses.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Prints&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwprint.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Prints on the runway weren’t all just the usual prints, some had a more raw feel it, and looked a little like graffiti or tribal art.&lt;/p&gt;\r\n\r\n&lt;p&gt;Cut Outs&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwcutout.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Cut-Out panelling seems to be a trend among fashion students, and I don’t just mean in Lim Kok Wing. There were several looks with cut outs, and geometric shapes that gave a very edgy, futuristic feel to it.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Fish Scales&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwscales.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This scaly texture made an appearance during the runway show, and I must say I liked it very much. It was very versatile, giving the garments different feels as the young designers used different prints and sizes of the texture on their garments.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;High-Low Skirts and Tops&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-lkwhilo.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This was my favourite trend of the lot. Though some of the skirts were left plain, some high-low skirts were lined with different fabrics, and textures that made me put down my camera just to take a second look.&lt;/p&gt;\r\n\r\n&lt;p&gt;Overall, it was an interesting showcase, though I wished they had used professional models on the runway. And since I come from a different fashion college, it was good to be able to be exposed to and see student work and talent that other fashion colleges produce.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/runway-last.jpg&quot; style=&quot;width: 551px; height: 366px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.tonguechic.com/fashion/runway-report-lim-kok-wing-springsummer-2013-collections-at-mid-valley/&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n'),(18,1,'The Limkokwing Fashion Club','&lt;p&gt;All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that? The Limkokwing Fashion Club has just been launched last Saturday 30th April at Publika, Solaris Dutamas. The launch was graced by the presence of her Excellency, DYMM Sultanah Pahang Sultanah Hajjah Kalsom, Professor Emeritus Tan Sri, Dato Sri Dr Limkokwing and special guests as well as the University’s industry guests.&lt;/p&gt;\r\n','&lt;p&gt;Limkokwing Fashion Club, the new label bursting with energy has ready-to-wear apparel offering an assortment of versatile pieces, is definitely something we’ve got our eye on. From studded caps, sequined and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like t-shirts and hoodies for both sexes, it seems the stylish crowd may now halt their search.&lt;/p&gt;\r\n\r\n&lt;p&gt;The University has already proved its mettle after taking part in runway showcases at London Fashion Week, Paris and Osaka last year alone. The brand also has plans to be available internationally by the end of the year, no doubt in all the 11 countries the university already has a presence- including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;“&lt;em&gt;We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand&lt;/em&gt;,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://lifestyle.malaysia.msn.com/fashion/catwalk-catchup/photoviewer.aspx?cp-documentid=252230529&quot; target=&quot;_blank&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n'),(15,1,'Limkokwing University Launches Its Own Fashion Brand Named Limkokwing Fashion Club','&lt;p&gt;Limkokwing University, founded by visionary Tan Sri Datuk Seri Dr Lim Kok Wing, launched its own fashion label at Publika on 30 march 2013.&lt;/p&gt;\r\n','&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;The chancellor of Limkokwing University, Her Royal Highness Sultanah Hajjah Kalsom of Pahang graciously attended and was rapturously welcomed by students of Limkokwing University.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8625328500/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8543/8625328500_69df85fe43_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624222801/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8102/8624222801_3548349787_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624222217/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8542/8624222217_8677dbc77f_c.jpg&quot; /&gt;&lt;/a&gt; &lt;a href=&quot;http://www.flickr.com/photos/60897922@N05/8624220621/&quot; title=&quot;DSC_3665 (2).JPG by keehuachee, on Flickr&quot;&gt;&lt;img alt=&quot;DSC_3665 (2).JPG&quot; src=&quot;http://farm9.staticflickr.com/8107/8624220621_0eaf2dda86_c.jpg&quot; /&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;http://keehuachee.blogspot.com/2013/04/limkokwing-university-launches-its-own.html&quot;&gt;Source&lt;/a&gt;&lt;/p&gt;\r\n'),(22,1,'Who can say no to a world\'s first?','&lt;p&gt;Limkokwing Fashion Club is the brand new, world\'s first fashion label by Limkokwing University of Creative Technology from Kuala Lumpur, Malaysia.&lt;/p&gt;\r\n','&lt;p&gt;Available for worldwide shipping from &lt;a href=&quot;https://fashionclub.my&quot; target=&quot;_blank&quot;&gt;www.fashionclub.my&lt;/a&gt; and new-in on ASOS Marketplace. You will ﬁnd bold, conversation-starter pieces in black and rock and roll gold, to be worn with studs and sex appeal. A University that has taken the initiative to prove its relevance in the industry? From what we can see Creative Director Tiffanee Marie Lim is holding no punches. There truly is nothing like it.&lt;/p&gt;\r\n\r\n&lt;p&gt;Visit &lt;a href=&quot;http://www.limkokwing.net&quot; target=&quot;_blank&quot;&gt;www.limkokwing.net&lt;/a&gt; for more details.&lt;/p&gt;\r\n'),(24,1,'The Young and Restless in Juice Magazine','&lt;p&gt;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media2.jpg&quot; style=&quot;width: 824px; height: 583px; margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media3.jpg&quot; style=&quot;width: 824px; height: 583px; margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(12,1,'Limkokwing Fashion Club Kicks Off World Tour @ Jakarta Fashion Week','&lt;p&gt;Fashion enthusiasts seemed to be picking their favourite from the sleek and edgy clothes, highlighting Malaysia-inspired textiles. Shimmering accents combined with sheer material reflected fearlessness, while sequined jackets and crop tees spoke directly to daily ease.&lt;/p&gt;\r\n','&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;After successfully presenting fashion shows in Paris, London and Osaka, Limkokwing University of Creative Technology that has around 35,000 students in 165 countries, participated in the 2014 Jakarta Fashion Week for the first time. The students and alumni worked together in presenting their newest collection for Limkokwing Fashion Club, the world’s first label by a university.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The show also played African percussion and Asian music designed by the University’s own Sound and Music Academy as models walked the runway, attended by celebrities such as Acha Septriasa, Raline Shah, buyers and editors.&lt;/p&gt;\r\n\r\n&lt;p&gt;Internationally employable&lt;/p&gt;\r\n\r\n&lt;p&gt;With a track record of innovation, graduates also dominated the week, such as Friederich Herman, Shella Tanzilia, Harry Halim, the only Indonesian at Paris Fashion Week 2014, Michael Cools,Cynthia Chaerunnisa and many more.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club driven by the Faculty of Fashion and Lifestyle Creativity has plans to be available online and one should guess in all the 11 countries it has presence in including – the UK, Indonesia, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Faculty offers creative programs including certificate programs and a Diploma in Lifestyle Design, focusing on hair and make-up, as well as a Bachelors of Arts (Hons) in Fashion and Retail Design and a Diploma in Fashion and Retail Design. Visit www.limkokwing.net for more information on these and other their programs&lt;/p&gt;\r\n'),(23,1,'Fashion Club Creative Director Featured in Glam Magazine','&lt;p&gt;The heiress of the Limkokwing University Empire,which is a well established University in Malaysia, and was the first to be recognized as a University College in the country, Dato\' Tiffanee Marie Lim continues her father, Tan Sri Dato\' Sri Paduka Dr Limkokwing\'s legacy which has been around since 1991.&lt;/p&gt;\r\n','&lt;p&gt;.&lt;/p&gt;\r\n'),(26,1,'Limkokwing Fashion Club Featured on Remaja Magazine May issue','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja001.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja002.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja003.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja003a.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja004.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja005.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja006.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja007.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja008.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja009.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja010.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja011.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja012.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(25,1,'Limkokwing Fashion Club featured in Marie Claire magazine','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media_marie_clair.jpg&quot; style=&quot;width: 824px; height: 562px; margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(30,1,'Limkokwing Fashion Club Featured on Intrend Magazine ','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/111intrend1.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/intrendpage2.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(32,1,'Limkokwing Fashion Club Featured on Remaja Magazine ','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja1.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja3.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja4.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja5.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/remaja6.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(33,1,'Creative Director of Fashion Club Creates Waves ','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Telegraphy-01.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Telegraphy-02.jpg&quot; style=&quot;line-height: 1.6em; margin-left: -57px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Telegraphy-03.jpg&quot; style=&quot;line-height: 1.6em; margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(20,1,'Limkokwing Students Create World’s First University Fashion Label','&lt;p&gt;All students dream of the day they can see their own creations in the stores, and now, they can! What could be cooler than that? The Limkokwing University of Creative Technology has yet again created a world innovation, another ground breaking step forward in fashion.&lt;/p&gt;\r\n','&lt;p&gt;Limkokwing Fashion Club, the new label bursting with energy has ready-to-wear apparel offering an assortment of versatile pieces, is definitely something we’ve got our eye on. Bold and very cool, in the University’s signature black, the brand focuses on urban flare, with practical clothes that can take you from campus, to smart casual, to evening.&lt;/p&gt;\r\n\r\n&lt;p&gt;From studded caps, sequined and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like t-shirts and hoodies for both sexes, it seems the stylish crowd may now halt their search.&lt;/p&gt;\r\n\r\n&lt;p&gt;A world-first is no laughing matter! The brand has plans to be available internationally by the end of the year, no doubt in all the 11 countries the university already has a presence- including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you, and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes, that happen to be really practical, fun, and affordable.”&lt;/p&gt;\r\n\r\n&lt;p&gt;Named after witnessing the staggering talent found on campus, why not? The global fashion industry is worth billions and the University has already proved its mettle after taking part in runway showcases at Jakarta Fashion Week last year and at London Fashion Week, Paris and Osaka in 2013 alone.&lt;/p&gt;\r\n\r\n&lt;p&gt;No doubt, this is the university that will take you where you want to be!&lt;/p&gt;\r\n'),(21,1,'Limkokwing University achieves another first in fashion ','&lt;p&gt;Who doesn’t dream of being a fashion designer? Well, students of Malaysia’s premiere international university get the benefit of testing their well-known skills on Limkokwing Fashion Club- the world’s first fashion label created by a university.&lt;/p&gt;\r\n','&lt;p&gt;Definitely another reason to find out how Limkokwing is making such waves abroad- remember their shows in London and Paris? Even the new store at Publika is designed by graduates at Limkokwing, and student photographers and models burst with energy in their campaign photos. Why not sign up?&lt;/p&gt;\r\n\r\n&lt;p&gt;It is interesting to shop the collection because it will speak of the students’ ideas and wants- there are sequined and leather fitted jackets, t-shirts and hoodies for both sexes, specially designed handbags, backpacks and other student essentials.&lt;/p&gt;\r\n\r\n&lt;p&gt;It’s good to know our flag is being flown high abroad. “The whole idea is to prove we can run our own brand as students. The world’s first thing is great, but came along much later,” said Dato’ Tiffanee Marie Lim, Limkokwing University’s AVP for Talent and Brand Development, a graduate herself.&lt;/p&gt;\r\n\r\n&lt;p&gt;Make sure you check it out. The brand has plans to be available online, and one should guess in all the 11 countries the university already has a presence- including the UK, Cambodia and Southern Africa. Visit www.limkokwing.net for information on all their programmes.&lt;/p&gt;\r\n'),(13,1,'World’s First University Fashion Label via Limkokwing Fashion Club','&lt;p&gt;Limkokwing University of Creative Technology has introduced the world’s first fashion label created by students for students under the history making Limkokwing Fashion Club.&lt;/p&gt;\r\n','&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;The launch took place at Publika, Solaris Dutamas with the presences of Limkokwing University Chancellor DYMM Sultanah of Pahang Sultanah Hajjah Kalsom; alongside YAM Tengku Puteri Seri Lela Wangsa Pahang Tengku Tan Sri Hajjah Meriam and her husband YAB Datuk Seri Mohamed Taufeq Ozair and family; Limkokwing University Founder and President, Professor Emeritus Tan Sri Dato’ Sri Paduka Dr Limkokwing; Chairman of Limkokwing University Council and President of Perbadanan Putrajaya, Tan Sri Aseh; Limkokwing University Vice President and CEO of Centre for Content Creation, Dato Timothy Limkokwing Jr; Limkokwing University Associate Vice President and Fashion Club Creative Director, Dato’ Tiffanee Marie Lim; members of media; students and guests.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The grand event kicked off with Limkokwing’s student performances. It was followed by Limkokwing Fashion Club models on the runaway, who are students from 18 countries. Fashion Club Creative Director Dato’ Tiffanee Marie Lim launched the occasion by signing off on the commemoration board. The programme ended with most popular national song of Malaysia, IM4U.&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” said Dato’ Tiffanee, the daughter of Tan Sri Limkokwing.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes that happen to be really practical, fun, and affordable,” added Dato’ Tiffanee.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the age of 21, Dato’ Tiffanee was voted Prestige Magazine’s youngest ever ‘Most Promising Female under 40’. In 2010, she received the ASEAN Master Class Award as the Emerging Women Entrepreneur of the Year. She also organized the first fashion show by an African and Asian University at London Fashion Week in 2012 and moved on to organize shows at Paris, Japan and China. She is a talented and prolific writer, who has already published four books. She also mooted ‘The Magic of Limkokwing’, an award-winning radio programme which she has directed and scripted.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club is a comfy yet glamorous move towards adapting the biggest international trends in the fashion industry with an exciting combination of urban flair and various cultural inspirations for everyone.&lt;/p&gt;\r\n\r\n&lt;p&gt;“I can see that Limkokwing University’s students here are being encouraged to meet the needs of the current generation across the world. The University has totally given the right opportunity for its students to enhance their skills and creativity. Congratulations to the team on their new effort,” said Mr Krishnasamy from Klang, who attended the event during his shopping visit at the mall.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It was an impressive event by the students of Limkokwing University. I’m also very proud of the University’s achievement as being the first university around Asia to create its own fashion brand. The clothes are looking very trendy and attractive,” said Samantha, an international student from Mont Kiara.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club leads innovative designs made with the comfort and well-being of the customer in mind. From studded caps, sequinned and leather fitted jackets, specially designed handbags, backpacks, accessories and basics like T-shirts and hoodies for both genders.&lt;/p&gt;\r\n\r\n&lt;p&gt;Each concept carries the magic and sleek edge of current fashion and reflects what it takes to be a trend setter and style icon of future.&lt;/p&gt;\r\n'),(16,1,'Limkokwing University debuts a first in fashion','&lt;p&gt;What better place to give you the edge and skills you need to become successful within the international industry other than Limkokwing University? The arrival of Limkokwing Fashion Club has seen the students of Malaysia’s most globalized university exploring their skill sets of creativity, boldness and high spirit on the brand.&lt;/p&gt;\r\n','&lt;p&gt;With the University making waves at home and abroad, it is hard to miss this dramatic accomplishment in fashion. Having achieved success with their shows in the worlds fashion capitals such as London and Paris, the journey has developed into the first ever retail brand by a University. Even the new store at Publika was designed by graduates at Limkokwing, energized by student photographers, and models showcasing their best efforts in creativity and innovation.&lt;/p&gt;\r\n\r\n&lt;p&gt;It is interesting to shop the collection because it speaks of the students’ ideals and wants through the University’s signature black colour collection which can transition easily between day and night. There you will find youthful styles ranging from sequined and leather fitted jackets, t-shirts and hoodies for both sexes, specially designed handbags, backpacks, and the hip student essentials.&lt;/p&gt;\r\n\r\n&lt;p&gt;It’s good to know our flag is being flown high abroad. “The whole idea is to prove we can run our own brand as students and provide the opportunities they deserve. The world’s first recognition is great, but came along much later and we are happy to innovate for Malaysia,” said Dato’ Tiffanee Marie Lim, Limkokwing University’s AVP for Talent and Brand Development, a graduate herself.&lt;/p&gt;\r\n'),(19,1,'Limkokwing features world’s first in Fashion at Mid Valley Fashion Week','&lt;p&gt;The Limkokwing University of Creative Technology through its world first fashion label , Limkokwing Fashion Club, presented its bold and fresh collection last Friday 12 April at the just ended Mid Valley Mega Mall Fashion week.&lt;/p&gt;\r\n','&lt;p&gt;The showcase was graced by His Excellency YBhg Tan Sri Dato’ Seri Dr Aseh Che Mat and Puan Sri Aseh, Limkokwing University Council Chairman and President of Putrajaya Holdings, Dato’ Danny Ooi, founder of The Malaysia Book of Records and Tan Sri, Dato’ Sri Paduka Dr Limkokwing as well as special guests and the University’s industry guests.&lt;/p&gt;\r\n\r\n&lt;p&gt;The presentation of the cool student wear was heralded by a showcase of Limkokwing student’s wealth of creativity through song and dance performances from the Sound and Music and Performance Arts Academies. Every aspect of the show production from performances, music composition, choreography, hair and make-up design alongside with the run way collection were created from concept to execution by the students of Limkokwing University themselves.&lt;/p&gt;\r\n\r\n&lt;p&gt;Thirty-five models from more than 20 countries such as from the United Kingdom, Mexico, Colombia, Lithuania, Kazakhstan, Iran, Brazil, Venezuela, Indonesia, China, Malaysia showcased garments from the Fashion Club Brand collection and Student Award winning design collection.&lt;/p&gt;\r\n\r\n&lt;p&gt;This special showcase included leading retailers Nose, Pepe Jeans, Inglot who sponsored us with their trendy products as well as Sharp, HSBC and Mid Valley Mega Mall with whom lent us their support.&lt;/p&gt;\r\n\r\n&lt;p&gt;The fashion week showcase just came a week after Limkokwing University launched the world’s first ever fashion label to be created by a university which was initiated by Dato’ Tiffanee Marie Lim, Associate Vice President Talent and Brand Development.&lt;/p&gt;\r\n\r\n&lt;p&gt;“We hope to inspire our students, but not just them, anybody, if we are able, to make them feel closer to getting where they want to be, and taking the mystery out of starting your own business or brand,” says Fashion Club Creative Director and Limkokwing Associate Vice President, Dato’ Tiffanee Marie Lim.&lt;/p&gt;\r\n\r\n&lt;p&gt;“It is a powerful feeling knowing that you are part of something that supports you, and part of an environment or brand that makes you feel at home. Limkokwing Fashion Club is an example of that. We hope we can bring a sense of belonging and a sense of style to anyone that likes clothes, which happen to be really practical, fun, and affordable.”&lt;/p&gt;\r\n\r\n&lt;p&gt;The brand inspired by the international community of Limkokwing students from 156 countries has plans to be available across the world by the end of the year, no doubt in all the 11 countries that the university already has a presence in, -including UK, Cambodia and Southern Africa.&lt;/p&gt;\r\n'),(42,1,'Fashion Club Creative Director Featured in Prestige Magazine','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Prestige-02.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Prestige-03.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(43,1,'Fashion Club Creative Director Featured in Life Inspired Magazine','&amp;nbsp;','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Inspired-02.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Inspired-03.jpg&quot; style=&quot;margin-left: -57px;&quot; /&gt;&lt;/p&gt;\r\n'),(44,1,'All Set for London Fashion Week','&lt;p&gt;Every fashion designer dreams of displaying their collection at the world\'s top runway shows such as the London Fashion Week, Milan Fashion Week and Paris Fashion Week.&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Media_LondonFashionWeek_Star_13feb17.jpg&quot; style=&quot;float: left;&quot; /&gt;&lt;/p&gt;\r\n'),(45,1,'Limkokwing invited for London Fashion Week','&lt;p&gt;Limkokwing University and its very own label, Limkokwing Fashion Club, will fly to London on 17 February to participate and showcase original designs at the London Fashion Week.&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Media_LondonFashionWeek_NewSundayTribune_13feb17.jpg&quot; style=&quot;width: 824px; height: 929px;&quot; /&gt;&lt;/p&gt;\r\n'),(46,1,'Hot off The Runway','&lt;p&gt;Limkokwing University\'s in-house label stunned the runway of London Fashion Week with its striking collection of unique high street pieces.&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media 1.jpg&quot; style=&quot;width: 824px; height: 929px;margin-left:-90px;&quot; /&gt;&lt;/p&gt;\r\n'),(48,1,'Lim Kok Wing Fashion Club Ke London','&lt;p&gt;&lt;span style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px;&quot;&gt;Lim Kok Wing University menerusi Lim Kok Wing Fashion Club mencipta sejarah tersendiri apabila berpeluang terbang ke London pada 17 Februari ini untuk menyertai persembahan London Fashion Week.&lt;/span&gt;&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Harian Metro - 13.2.2017.jpg&quot; style=&quot;width: 1298px; height: 543px;&quot; /&gt;&lt;/p&gt;\r\n'),(47,1,'Scouting Young Fashion Talent ','&lt;p&gt;Students presented 43 designs that are a cultural mix of&amp;nbsp;ideas,fabrics,textures and colours on the catwalk.&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/main2.jpg&quot; style=&quot;width: 700px; height: 449px;&quot; /&gt;&lt;/p&gt;\r\n'),(53,1,'Pelajar LUCT serlah rekaan fesyen','&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: Droid Serif, DroidSerifRegular, Georgia, Times New Roman, Times, serif; font-size: 16px; text-align: justify; text-indent: 24px;&quot;&gt;Universiti Kreatif Lim Kok Wing (LUCT) mencipta sejarah tersendiri apabila menjadi satu-satunya universiti di negara ini yang berpeluang membuat pertunjukan fesyen di persada antarabangsa melalui penyertaan di London Fashion Week, pada penghujung bulan lalu.&lt;/span&gt;&lt;/p&gt;\r\n','&lt;p data-bind=&quot;text:&quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Universiti Kreatif Lim Kok Wing (LUCT) mencipta sejarah tersendiri apabila menjadi satu-satunya universiti di negara ini yang berpeluang membuat pertunjukan fesyen di persada antarabangsa melalui penyertaan di London Fashion Week, pada penghujung bulan lalu.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Naib Presiden Jenama, Kreativiti dan Pembangunan Bakat LUCT, Datuk Tiffanee Marie Lim, berkata koleksi yang dihasilkan dalam tempoh sebulan itu mencerminkan kepelbagaian dan keunikan yang dimiliki pelajar universiti yang datang dari 14 negara di seluruh dunia.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text:&quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;“LUCT mempunyai rangkaian perhubungan yang unik. Kami berkongsi mengenai cara kehidupan masing-masing dan bertukar idea untuk menjayakan pertunjukan di London Fashion Week ini,” katanya dalam satu kenyataan, di sini, baru-baru ini.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;LUCT dan Lim Kok Wing Fashion Club diberi peluang memperkenalkan koleksi dinamik yang dihasilkan pada hari pertama berlangsungnya London Fashion Week di Freemasons’ Hall, Covent Garden, London.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text:&quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Koleksi menakjubkan itu dihasilkan dengan mengetengahkan konsep gabungan pakaian mewah dan streetwear yang berjaya mempesonakan penonton dengan rekaan menampilkan potongan berani, perincian fabrik yang baik dan hasil kerja yang berkualiti.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Berfikir di luar kotak&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Koleksi itu turut meneroka keunikan yang dimiliki warisan fesyen daripada masyarakat Afrika dan Asia yang mencerminkan keunikan budaya dimiliki pelajar LUCT.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Koleksi itu merangkumi pakaian menggunakan cetakan silang budaya, perhiasan kepala yang mewah dan aksesori, manakala pemilihan fabrik pula dibuat berdasarkan kebudayaan dari negara Swaziland, Zimbabwe, Lesotho, Botswana, Indonesia, Iran dan Malaysia.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;LUCT sentiasa menggalakkan pelajarnya untuk berfikir di luar kotak dan menerapkan aspek integrasi seni, budaya dan trend sosial dalam fesyen dipilih oleh panel terdiri daripada pakar industri, sekali gus menjadi satu-satunya universiti asing diberi peluang membuat pertunjukan fesyen pada acara mewah bertaraf dunia itu.&lt;/p&gt;\r\n\r\n&lt;p data-bind=&quot;text: &quot; style=&quot;margin: 0px; font-size: 16px; line-height: 1.6; color: rgb(0, 0, 0); background-color: transparent; box-sizing: border-box; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; text-indent: 1.5em; text-align: justify; overflow: hidden; text-overflow: ellipsis; font-family: &amp;quot;Droid Serif&amp;quot;, DroidSerifRegular, Georgia, &amp;quot;Times New Roman&amp;quot;, Times, serif;&quot;&gt;Peluang mengadakan pertunjukan fesyen di London Fashion Week yang dijalankan dengan kerjasama pertunjukan bebas terbesar dari United Kingdom, Fashion Scout itu bukan saja menyediakan pentas kepada pelajar untuk mempamerkan rekaan mereka kepada umum tetapi juga mencuri perhatian pereka tersohor dunia.&lt;/p&gt;\r\n'),(54,1,'Check out these Raya designs by Limkokwing Fashion Club','&lt;p&gt;Add some glamour during Hari Raya and go for some shimmer and shine. Limkokwing Fashion Club, a label by the namesake university, recently launched its first ever Hari Raya collection.&lt;/p&gt;\r\n','&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Roboto; font-size: 14px;&quot;&gt;Titled Malaysian Soul, the exclusive 12-piece collection is said to portray diverse elements from Malaysian cultures. It also takes into account the aesthetics of various races.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Roboto; font-size: 14px;&quot;&gt;The design details can apparently be traced back to Malaysian architecture, as well as signature prints of the country. Modern touches however, come in the form of golden glitter and sequins.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 0px 0px 10px; color: rgb(0, 0, 0); font-family: Roboto; font-size: 14px;&quot;&gt;Datuk Tiffanee Marie Lim, vice president of brand creativity and talent development of Limkokwing University, expressed her excitement for the Raya Collection and mentioned that it is a new territory for the label.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;br style=&quot;box-sizing: border-box;&quot; /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/joyce_side_28042017_02.jpg&quot; /&gt;&lt;br /&gt;\r\n“I’m really proud of the design team that has put this together. This collection is very different from what we are used to, but I think it’s very important to be current and relevant,” she stated.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/moreblessing_front_28042017_01.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/asal_front_28.04.2017.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/indira_front_28042017_01.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/maureen_side_28042017_02.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/vee_front_28042017_01.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/adilya_front_28042017.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/chandra_front_28042017_01.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/hasreena_front_28042017.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/antonija_front_28042017.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/adelina1_28042017.jpg&quot; style=&quot;width: 800px; height: 900px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/sean_front_28042018_01.jpg&quot; style=&quot;width: 800px; height: 900px;&quot; /&gt;&lt;br /&gt;\r\n&lt;a href=&quot;http://www.star2.com/style/2017/06/22/check-out-these-raya-designs-by-limkokwing-fashion-club/&quot;&gt;http://www.star2.com/style/2017/06/22/check-out-these-raya-designs-by-limkokwing-fashion-club/&lt;/a&gt;&lt;/p&gt;\r\n'),(55,1,'LimKokWing’s unique blend dazzles the crowd','&lt;div class=&quot;page&quot; title=&quot;Page 1&quot;&gt;\r\n&lt;div class=&quot;section&quot;&gt;\r\n&lt;div class=&quot;layoutArea&quot;&gt;\r\n&lt;div class=&quot;column&quot;&gt;\r\n&lt;p&gt;FASHION in itself is an individualistic expression of creativity and braveness that are closely related to Tan Sri Dato’ Sri Paduka Dr. Limkokwing’s vision about creative education.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','&lt;div class=&quot;page&quot; title=&quot;Page 1&quot;&gt;\r\n&lt;div class=&quot;section&quot;&gt;\r\n&lt;div class=&quot;layoutArea&quot;&gt;\r\n&lt;div class=&quot;column&quot;&gt;\r\n&lt;p&gt;Limkokwing University, being a creative and innovative university, offers Fashion Design as one of its many courses.&lt;/p&gt;\r\n\r\n&lt;p&gt;Students are expose to not only theories in class, rather they are given the opportunity to experience being in the industry itself.&lt;/p&gt;\r\n\r\n&lt;p&gt;Four years ago, the Faculty of Fashion and Lifestyle Creativity, gave birth to its own fashion label better known as Limkokwing Fashion Club. The fashion label serves as a platform for students to get more involve with production and retail site of the fashion world.&lt;/p&gt;\r\n\r\n&lt;p&gt;Created by Dato’ Tiffanee Marie Lim, the label is the first to be created by a University.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lubdtc_01_00114.07.2017-01-01.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The brand releases an array of collections every three months and is divided into four categories being essentials, runway pieces, evening and limited editions with prices ranging between RM 89 to RM 899.&lt;/p&gt;\r\n\r\n&lt;p&gt;Getting inspired by the multi- cultural nature of Limkokwing with its students comprising of various ethnicities from around the world, its fashion label designs are based on this and what people wear daily.&lt;/p&gt;\r\n\r\n&lt;p&gt;The exposure expands with the club organizing Fashion Club Thursday, hosted by the fashion community of Limkokwing – a day where students would create new ideas, new stage layout and new themes for fashion shows.&lt;/p&gt;\r\n\r\n&lt;p&gt;Recently, Limkokwing Fashion Club took its involvement to the Borneo Fashion Week (BFW) 2017 held on July 7 to 9 at Borneo 744 Art Centre, Bintawa in Kuching.&lt;/p&gt;\r\n\r\n&lt;p&gt;BFW becomes host to many international and local famous fashion labels showcasing each creativity, as it aims to present the opportunity to put the iconic Borneo fashion on world stage of fashion.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club harmoniously merged the heritage values found in Malaysia, with embedded traits and influences from Malay, Chinese, and Indian culture into its Malaysian Soul col- lection which was presented during the fashion show.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lubdtc_02_00114.07.2017-01-01-01.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;TOH &lt;/strong&gt;Puan Ragad Waleed Alkurdi presenting the “Most Promising Sarawakian Designer 2017” award to Aaron G. Von Jolly of Von Jolly Couture witnessed by (from left) Datin Nikki Lugun, Stephanie Alcantara, Datin Esther Balan, Azhar Zainal of AZ Brothers, Yacub Taha of Yacutha, Datin Amar Juma’ani Tuanku Bujang and Datin Amar Fatimah Mohd Iskandar.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;page&quot; title=&quot;Page 1&quot;&gt;\r\n&lt;div class=&quot;section&quot;&gt;\r\n&lt;div class=&quot;layoutArea&quot;&gt;\r\n&lt;div class=&quot;column&quot;&gt;\r\n&lt;p&gt;The Borneo Fashion Week 2017 panel of judges comprised of three highly accomplished individuals namely Datin Nikki Lugun, Director of Corporate Communications for Limkokwing University of Creative Technology, Amir Luqman, Creative Director/ Designer of Jazalo Equalliance Sdn. Bhd., and Dr Esther Michael, Founder and Managing Director of Borneo Medispa.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing University of Creative Technology is a private international University with a presence across Africa, Europe, and Asia, with its main campus in Cyberjaya, Malaysia.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the moment, the University has over 30,000 students from more than 165 countries, study- ing in 14 campuses located in Botswana, Cambodia, China,etc.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;GUESTS &lt;/strong&gt;of Honour, Datin Amar Juma’ani Tuanku Bujang and Toh Puan Ragad Waleed Alkurdi, with Limkokwing models donning the Limkokwing Fashion Club “Malaysian Soul” Raya 2017 collection. Also seen in the picture are Dato’ Raymond Jolly, Datin Esther Balan and Datin Nikki Lugun.&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lubdtc_03_00114.07.2017-01-01-01.jpg&quot; style=&quot;width: 824px; height: 412px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;page&quot; title=&quot;Page 1&quot;&gt;\r\n&lt;div class=&quot;section&quot;&gt;\r\n&lt;div class=&quot;layoutArea&quot;&gt;\r\n&lt;div class=&quot;column&quot;&gt;\r\n&lt;p&gt;The Borneo Fashion Week 2017 panel of judges comprised of three highly accomplished individuals namely Datin Nikki Lugun, Director of Corporate Communications for Limkokwing University of Creative Technology, Amir Luqman, Creative Director/ Designer of Jazalo Equalliance Sdn. Bhd., and Dr Esther Michael, Founder and Managing Director of Borneo Medispa.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing University of Creative Technology is a private international University with a presence across Africa, Europe, and Asia, with its main campus in Cyberjaya, Malaysia.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the moment, the University has over 30,000 students from more than 165 countries, study- ing in 14 campuses located in Botswana, Cambodia, China,&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;GUESTS &lt;/strong&gt;of Honour, Datin Amar Juma’ani Tuanku Bujang and Toh Puan Ragad Waleed Alkurdi, with Limkokwing models donning the Limkokwing Fashion Club “Malaysian Soul” Raya 2017 collection. Also seen in the picture are Dato’ Raymond Jolly, Datin Esther Balan and Datin Nikki Lugun.&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lubdtc_04_00114.07.2017-01-01-01.jpg&quot; /&gt;&lt;br /&gt;\r\nIndonesia, Lesotho, Sierra Leone, Swaziland and the United Kingdom.&lt;/p&gt;\r\n\r\n&lt;div class=&quot;page&quot; title=&quot;Page 1&quot;&gt;\r\n&lt;div class=&quot;section&quot;&gt;\r\n&lt;div class=&quot;layoutArea&quot;&gt;\r\n&lt;div class=&quot;column&quot;&gt;\r\n&lt;p&gt;Limkokwing Borneo campus located at Jalan Nanas, Kuching has various creative based courses such as Diploma in Fashion and Apparel Design, Diploma in Architectural Technology, Diploma in Interior Design, Diploma in Graphic Design, Diploma in Animation and Multimedia Design, and Diploma in Mass Communication.&amp;nbsp;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lubdtc_05_00114.07.2017-01-01-01.jpg&quot; /&gt;&lt;strong&gt;LIMKOKWING &lt;/strong&gt;University presented innovative cultural pieces that were first unveiled to the public at the 2017 London Fashion Week.&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n'),(56,1,'Marie Claire: &quot;Amazing Women 2017&quot;','&lt;p&gt;Marie Claire\'s very DNA lies in celebrating women. Focused,fearless and brilliant, the ten Amazons of substance and style we\'ve selected this year embody the qualities we admire and champion.&amp;nbsp;&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/August-Cover.jpg&quot; style=&quot;width: 700px; height: 933px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media_mc2.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media_mc3.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/media_mc4.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n'),(57,1,'Harper\'s BAZAAR November 2017 - Personal Style: Dato\' Tiffanee Marie Lim ','&lt;p&gt;The vice president of brand creativity and talent development at Limkokwing University on high living, style inspirations, and her favourite fashion designers. by Mughni Che Din.&lt;/p&gt;\r\n','&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/bazar_01dato_2017.jpg&quot; style=&quot;width: 1025px; height: 649px;margin-left:-150px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/bazar_02dato_2017.jpg&quot; style=&quot;width: 1025px; height: 649px;margin-left:-150px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/bazar_03dato_2017.jpg&quot; style=&quot;width: 1025px; height: 649px;margin-left:-150px;&quot; /&gt;&lt;/p&gt;\r\n');
