INSERT INTO `oc_simple_blog_article_description` VALUES (75,13,1,'This Blog Begins Now!','&lt;p&gt;Hello friends, this is the start of a special journey. Welcome to Limkokwing Fashion Club, the world’s first and only fashion label by a University. Representing Limkokwing University of Creative Technology, one of the fastest-growing University brands, we are proof that creative education makes special people, and special things.&lt;/p&gt;\r\n\r\n&lt;p&gt;As Creative Director, I couldn’t be more proud to take you through snippets of our world, showing you pictures and videos of our daily lives, friends and aspirations.&lt;/p&gt;\r\n\r\n&lt;p&gt;This label has introduced us to incredible people, and opened so many doors. In the 2 years since opening, we have sold to 44 countries online and attract clients via our stores, countless shows and some respectable press.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe product and image you experience here has been put together by either a student or graduate of Limkokwing University, including the models and software engineers. We have here a global innovation, which with your help will continue to trail blaze.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Limkokwing Fashion Club is for the empowered, brave and globally minded.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Stick around if you would like to learn something.&lt;/em&gt;&lt;/p&gt;\r\n','',''),(76,14,1,'Culture Club, 165 Countries &amp; Counting!','&lt;p&gt;&lt;img alt=&quot;culture club &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/17/c2b78a14-abb7-4ba5-bedc-98d42d656baf_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nLimkokwing is a university with students from over 165 countries. With all that culture under just ONE roof we are lucky enough to have the chance to embrace each and every culture all day every day!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;joyce eyes up &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/17/5a68b187-48a6-4627-805f-fee14affdb8b_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThis gorgeous girl is Joyce, a graduate from Fashion and Retail Design at Limkokwing University. Believe it or not she’s actually one of our fabulous fashion designers for Limkokwing Fashion Club! Coming from Taiwan she’s always rocking the newest trends but today she’s taking a step back from the modern trends and totally owning this traditional Chinese Qi Pao.&lt;/p&gt;\r\n\r\n&lt;p&gt;Joyce wears our &lt;strong&gt;Elizabeth Necklace.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;niamh thai&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/17/e8c4f8f3-4b07-4cb3-b971-db7f314174d6_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nNiamh is proudly dressed in some of the colours from her flag but surprisingly today she is representing Thailand instead of her home Ireland!&lt;/p&gt;\r\n\r\n&lt;p&gt;Niamh makes claws WIN whilst she wears our &lt;strong&gt;Six Layered Indian Cuff.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;alua blue&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/17/95e2621c-a775-472e-9fc1-d115d8da7a6f_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nI was chuffed to spot Alua for the first time today all the way from Kazakhstan looking even more stunning than the deep blue sky today in Vietnam’s traditional costume.&lt;br /&gt;\r\nAlua wears the &lt;strong&gt;Skull Cross Mega Necklace effortlessly.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;Kat japanese&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/17/1e11b551-321d-4360-9840-e0493ed7a92b_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nToday I decided to go back to my cosplaying roots and wore a Japanese Kimono. As soon as I tried on the costume I knew that two cheeky buns were definitely in store to complete the look.&lt;br /&gt;\r\nI’m wearing an item from our new collection, the &lt;strong&gt;Tribe Silver Necklace.&lt;/strong&gt;&lt;/p&gt;\r\n','',''),(77,15,1,' Here come the girls...','&lt;p&gt;&amp;nbsp;&lt;img alt=&quot;rooftop group 2&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/02/da8bd17e-b399-442d-9ea2-3b0a534c8273_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We are super excited to announce that Limkokwing Fashion Club has taken on board a fabulous new trio of ladies! We will ensure that a slice of each individuals flavour is brought to your screens every week. Now living in Asia, we three are constantly eager to explore our surroundings IN STYLE, so this won’t be your typical fashion blog- trust us- we will take you all over the world! Having all graduated from performing arts school, we are always on the move! Hungry for new styles and adventures, Limkokwing University’s fashion label, Limkokwing Fashion Club, has given us endless inspiration! Whether it’s trekking through the jungle, relaxing on the beach, dancing our hearts out or even meeting the Royal family, we will be taking these opportunities with both hands whilst sporting this unique label.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;kat rooftop &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/02/f46dfd8c-d0fc-49a0-b4b3-ff0c2ee4d12d_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;br /&gt;\r\nKat wears our &lt;strong&gt;Sequin Disco Sweater&lt;/strong&gt; and our &lt;strong&gt;Studded Leather Backpack&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;niamh rooftop &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/02/7607644e-be4c-4f0c-b896-37050312006f_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;br /&gt;\r\nNiamh wears our &lt;strong&gt;Fringe Star Biker Jacket&lt;/strong&gt; and our &lt;strong&gt;Christina Hoops Earrings&lt;/strong&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;gab rooftop&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/02/061d11d1-5eab-4046-beab-22d23bdfa4ee_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;br /&gt;\r\nGabby wears our &lt;strong&gt;Indian 6 Cuff Layers&lt;/strong&gt; with our &lt;strong&gt;Skull Cross Mega Necklace&lt;/strong&gt; and not forgetting our latest edition &lt;strong&gt;Snakeskin Golden Holder Clutch!&lt;/strong&gt;&lt;/p&gt;\r\n','',''),(78,16,1,'LOVE RUDE EYE PHOTOGRAPHY','&lt;p&gt;&lt;strong&gt;One of the best feelings ever is catching up with young talents we met years ago at the University and hearing about how they chose to leave their footprints in the world.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Gabrielle Boudville is a graduate in Fashion and Retail Design, who has since found her way via Milan to London as a fashion model and passionate photographer. She is a young Malaysian powerhouse beauty who looks keenly at you dead in the eye, speaking only little.&lt;/p&gt;\r\n\r\n&lt;p&gt;It is easy to underestimate one that doesn’t beat their own chest, but Gabby’s skills are certainly not easy to ignore. I knew she was cute when she made an outstanding Arabic-inspired collection in her final year in Fashion. I was so impressed I brought some of her work to show at London Fashion Week 2012. She’d been modeling professionally and with us the whole time and looks right at home on the runway, it really was no surprise that everybody booked her!&lt;/p&gt;\r\n\r\n&lt;p&gt;Now she works with Love Rudeye, the UK’s Number 1 professional dance agency as a photographer, making their members look amazing. Obviously they wear Fashion Club perfectly!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Have a look at some of her photographs here, and find the agency at &lt;a href=&quot;http://www.loverudeye.com&quot;&gt;www.loverudeye.com&lt;/a&gt;.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Stuart Bishop&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/30/ce7ee6cc-5836-4b00-9173-1438a6c9d675_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Christina Andrea&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/30/1858f4d9-1501-44a3-b49a-c52dcbf4e268_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Charlie Bruce&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/11/30/e292da31-eac5-453b-af12-3e4eef91feb7_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Yasmin Ogbu&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/12/02/237439f5-d82b-473f-85a1-7344ae95d38f_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Yasmin Ogbu&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/12/02/001105a8-6486-4b69-8a0d-3b167f3655dd_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Christina Andrea&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2015/12/02/db65318c-fc49-480e-b467-9cce40b6e6c5_huge.jpg&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n','',''),(83,17,1,' New Year, New Possibilities ','&lt;p&gt;We at Limkokwing Fashion Club are ecstatic with the response that we have received from you all, we wouldn’t be where we are now without you! As a young label we are flattered to have attracted such high profiled individuals that inspire us with their quirky, flamboyant ways of styling the brand. In fact it’s Fashion Club that has given us the chance to welcome such a creative circle of friends that we are eager to support and share the New Year with.&lt;/p&gt;\r\n\r\n&lt;p&gt;With new stores come new possibilities and that’s exactly what we’ve seen since the opening of our store in the holiday paradise, Bali! Seeing our customers creating memories in the sea and sun whilst wearing our label is truly heartwarming. It’s experiences like these that keep us striving to become bigger and better and able to cater for all you fashion lovers around the world.&lt;/p&gt;\r\n\r\n&lt;p&gt;The new year of 2016 has already begun and we are excited to announce that we plan to expand to a place near YOU, how exciting is that?! It’s one thing buying online but to come and visit our stores is a whole new experience in itself! Did you know that our architecture students design the stores themselves? We even showcase our fashion student’s stunning garments in the store as a platform for their designs to become noticed by future employers. What’s more is that the models you see in our campaigns, the friendly retail staff you see working at our stores and not forgetting all the unique designs you see incorporated into our brand are all our students! Now you don’t see that in your typical retail store, so come and visit us to see for yourself.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;We hope that you had a fabulous Christmas and a Happy New Year.&lt;br /&gt;\r\nLots of Love,&lt;br /&gt;\r\nLimkokwing Fashion Club.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Adeline Tsen, Malaysian Actress &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/7a2eb301-8a5a-4ea6-b4cb-38e2a732911f_huge.jpg&quot;  title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Ambassador of America, Joseph Y. Yun&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/d3cbe9a2-61b5-45dc-8485-034349aa37ff_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;The Ambassador of Uruguay, His Excellency Gerardo Prato.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/51ceb9b6-1c5d-408a-b535-056145a2a52f_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Jeannie Camtu Mai, a fashion expert and TV personality.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/a23691d2-bcd3-410c-9752-249e28500b71_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Roosevelt Skerrit, Prime Minister of Dominica. &quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/4c8e9f30-4504-4991-b0c4-40a5cb131dca_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Samaya Mamedova in Japan, a student at Limkokwing University.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/4c5837e9-0294-45dd-8ca2-1ce3f5658384_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Shiha Zikir, a singer, host and actress. She was also the first runner up on Mentor5.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/0024e454-0e00-4a53-a59b-034cec57627a_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Ryzal Jaafar, an actress and model in Malaysia.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/417a9370-e105-4b96-bfe8-d9b59fe301ed_huge.jpg&quot; title=&quot;&quot;  style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Mark O\'Dea, currently a host on 8TV, Astro Super Sports and ESPNFC.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/708c6b61-003a-43ec-a215-ffee71d9cda1_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Creativity in Motion, a fashion show which showcased Limkokwing Fashion Club at Pavilion Mall in KL.&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/727b2fd9-d2f7-4e21-a999-2d061aa727dc_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Our London Campus staff ready to start a jam packed day of fashion at the worldwide known Portobello Market in London!&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/98363228-7024-474b-a7da-54fd6c09fa59_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;One of our favourite customers at Portobello Market in London, look at that sass!&quot; class=&quot;hastip tooltipsy-init&quot; src=&quot;https://marketplace-images.asos.com/2016/01/05/4051f456-834a-44d1-abd8-d7cadab8f9a7_huge.jpg&quot; title=&quot;&quot; style=&quot;display: block;\r\n    margin-left: auto;\r\n    margin-right: auto;&quot;/&gt;&lt;/p&gt;\r\n','',''),(88,19,1,'This year we spent Valentine’s with our first love: Fashion. ','&lt;p&gt;Fashion Week fever is building. It’s hard not to be enthralled. I like to try things, so this cold February, we are spending a week in London attending Pure London, one of the UK’s biggest trade shows in fashion.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;There are hundreds of exhibitors filling Kensington’s Olympia convention centre with their various wears: gloves, paper eyelashes, swimsuits, etc. We took a small stand and met all sorts of young people with big dreams. Limkokwing Fashion Club actually got some really nice attention- people loved the accessible glamour and naturally we got cool chicks with pink and blue hair, or dreads.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Fingers crossed we’ll strike up some interest from the fair, so wait for announcements.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Kat, David, Hannah and I went searching for some sunlight.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Written by Tiffanee Marie Lim&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12751672_10154021252092074_1125474783_o.jpg&quot; style=&quot;width: 760px; height: 570px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12752205_10154021251752074_299923199_o.jpg&quot; style=&quot;width: 760px; height: 570px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12754985_10154021252227074_2022555721_o.jpg&quot; style=&quot;width: 760px; height: 949px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12597082_10154021251627074_1568370795_o.jpg&quot; style=&quot;width: 760px; height: 1014px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12722167_10154021252027074_711926876_o.jpg&quot; style=&quot;width: 760px; height: 958px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12699024_10154021251962074_2038105638_o.jpg&quot; style=&quot;width: 760px; height: 1014px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12751815_10154021251867074_1739016315_o.jpg&quot; style=&quot;width: 760px; height: 1045px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/12699090_10154021252152074_1074618701_o.jpg&quot; style=&quot;width: 760px; height: 1013px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(91,20,1,'Burn Baby Burn!','&lt;p align=&quot;center&quot;&gt;Is it just me or are things becoming seriously hot in here?! I know what you’re thinking... And no I wasn’t &lt;strong&gt;JUST&lt;/strong&gt; talking about the forty degree weather in Malaysia recently!&lt;/p&gt;\r\n','',''),(92,21,1,'Make room for His Excellency Ian Khama!','&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Now if anyone was to ask me, what place next? I would&lt;strong&gt; ALWAYS&lt;/strong&gt; voice my love to visit Africa, nowhere specific, &lt;strong&gt;just AFRICA!&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n','',''),(94,22,1,'Release your inner Pinkcess!','&lt;p&gt;&lt;span style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 13px;&quot;&gt;We are so excited for our new collection to be released, excited enough to sneakily take a photo just for YOU before we start selling them in our stores! Check out Kat from Britain wearing our new edition headbands as well as our black sequins bomber jacket.&lt;/span&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RYIP_01.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RIYP_02.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RYIP_03.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RYIP_04.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RYIP_05.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/RYIP_06.jpg&quot; /&gt;&lt;/p&gt;\r\n','',''),(105,24,1,'Delicious in Darks','&lt;p&gt;I’m not sure if you guys have checked out Limkokwing Fashion Club’s accessories recently BUT they have a wide range of glamourous earrings and necklaces made especially for all us DIVAS out here!&lt;/p&gt;\r\n\r\n&lt;p&gt;Maureen, one of the university’s alumni who now works and designs for Fashion Club, pairs our deep purple Peacock Collection Earrings with dark purple lipstick- YUM!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_01_august16.jpg&quot; style=&quot;width: 1025px; height: 700px; float: left;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_02_august16.jpg&quot; style=&quot;height: 1501px; width: 1025px; float: left;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;I myself chose to go with a sleek and classy look today by wearing the Triple Shell Earrings paired with red lipstick and not forgetting the NEW Keyring accessories that adds depth to any outfit of my choice.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_04_august16.jpg&quot; style=&quot;width: 1025px; height: 700px; float: left;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_05_august16.jpg&quot; style=&quot;width: 1025px; height: 700px; float: left;&quot; /&gt;&lt;/p&gt;\r\n','',''),(107,25,1,'On Your Marks, Get Set- GO!','&lt;p&gt;The university campus is slowly but surely filling up with fresh faces from all over the globe; guess why? The new semester term is here!&lt;br /&gt;\r\n&lt;br /&gt;\r\nLimkokwing Fashion Club was jam packed over the holiday break, even I had to queue to get my hands on some of the remaining pieces from the previous collections but YES was it worth it as I’ve already worn them over and over again!&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf you check out Fashion Club’s stores they’ve got some gorgeous new arrivals, see me below wearing their &lt;strong&gt;Silver Ring Jumpsuit&lt;/strong&gt; paired with our &lt;strong&gt;Basic V-Striped Cropped Top&lt;/strong&gt;! And of course, I LOVE to mix the old with the new, holla to Fashion Club’s previous collections &lt;strong&gt;Spiky Girl Wallet!&lt;br /&gt;\r\n&lt;br /&gt;\r\nVisit their stores now at Publika, Mid Valley, on campus, in Seminyak Village in Bali and not forgetting our friends from the UK- visit their showroom at 106 Picadilly!&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blogcontent01-26aug2016.jpg&quot; style=&quot;width: 1025px; height: 649px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blogcontent02-26aug2016.jpg&quot; style=&quot;width: 1025px; height: 649px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blogcontent03-26aug2016.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blogcontent04-26aug2016.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blogcontent05-26aug2016.jpg&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n','',''),(114,26,1,'All Black Everything with Adilya','&lt;p&gt;Ever wondered more about the people behind the scenes of Limkokwing Fashion Club? Meet Adilya from Kazakhstan who is a student at Limkokwing University and is currently studying her Degree in Fashion and Retail Design!&lt;/p&gt;\r\n\r\n&lt;p&gt;Whilst studying, Adilya is a proud designer of Limkokwing Fashion Club, meaning that after she graduates- her designs are already in real life retail stores- how cool is that!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;em&gt;“As a young designer I feel that I’m extremely privileged to be working for Limkokwing Fashion Club as it’s the perfect platform for students like me who crave for the experience and exposure that Limkokwing creates. It’s wonderful to see people from all over the world purchasing designs made by me, such as the &lt;strong&gt;oversized men’s shirt&lt;/strong&gt; as it connects you with the world in a different way- through fashion.”&lt;/em&gt; &lt;strong&gt;Adilya Botabayeva&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_banner_03_2september2016.jpg&quot; style=&quot;width: 700px; height: 443px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAdilya wears our &lt;strong&gt;Gold Ring Choker&lt;/strong&gt; and &lt;strong&gt;Budda Rock Necklace&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_banner_02_2september2016.jpg&quot; style=&quot;width: 700px; height: 443px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(116,27,1,'Glitter Coordinates','&lt;p&gt;I’ve been with Fashion Club since the start and something that I’ve noticed about the brand is that it’s SURE to stand out. By creating statement pieces we also along the way pick up some pretty unique buyers, check out this stunner, &lt;strong&gt;Ludo,&lt;/strong&gt; who studies &lt;strong&gt;Communication with Psychology&lt;/strong&gt; at Limkokwing University flaunting the &lt;strong&gt;Fun House Mesh Sleeves&lt;/strong&gt; with its lil sis coordinate the &lt;strong&gt;Fun House Mini Backpack&lt;/strong&gt;!&lt;/p&gt;\r\n\r\n&lt;p&gt;I love the way that Ludo has made a bold statement with her spearmint green hair, if you haven’t got your hair coloured yet come to Limkokwing’s campus and get it done here at &lt;strong&gt;Headlines &lt;/strong&gt;as believe it or not, they have their own salon!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_05_15sep2016.jpg&quot; style=&quot;width: 700px; height: 700px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_06_15sep2016.jpg&quot; style=&quot;width: 700px; height: 806px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_04_15sep2016.jpg&quot; style=&quot;width: 700px; height: 611px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_03_15sep2016.jpg&quot; style=&quot;width: 700px; height: 700px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_02_15sep2016.jpg&quot; style=&quot;width: 700px; height: 700px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_07_15sep2016.jpg&quot; style=&quot;width: 700px; height: 700px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(120,28,1,'Sneaker Game','&lt;p&gt;&lt;strong&gt;In Mean Girls they have Pink Wednesday\'s but at Limkokwing we were cooler and rocked Sneaker Friday!&lt;/strong&gt;&lt;/p&gt;\r\n','',''),(124,29,1,'Magic Dance Crew','&lt;p&gt;Studying just isn’t enough for some and I totally agree as making the most out of your time whilst being a student is vital as once you graduate- it’s time to say hello to the real world!&lt;br /&gt;\r\n&lt;br /&gt;\r\nA handful of our students keep themselves occupied all day every day, rehearsing for the next show, learning brand new styles and doing Limkokwing proud by choreographing their own inspirational videos. You probably already know, but if you don’t, we take pride in pushing our students to be as unique as possible and we tried to capture this in our most recent shoot that took place in various locations all over Cyberjaya.&lt;br /&gt;\r\n&lt;br /&gt;\r\nIf you’d like to join Limkokwing Dance Club, feel free to register as we LOVE taking our time to teach and train new members. At only 200RM a semester with tons of classes throughout the week, it’s really not something to miss out on whether you’re a Limkokwing student, staff or a normal person looking for a way to keep fit, make friends and just generally enjoy yourself to music!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Email &lt;a href=&quot;mailto:Katherine.odea@limkokwing.edu.my&quot;&gt;Katherine.odea@limkokwing.edu.my&lt;/a&gt; for more information on how you can be part of our team!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_02_19oct2016.jpg&quot; style=&quot;width: 800px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Eunjin from South Korea wears our &lt;strong&gt;Painted Sleeved Biker Jacket&lt;/strong&gt; and our &lt;strong&gt;Silver Ring Choker&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_03_19oct2016.jpg&quot; style=&quot;width: 800px; height: 1056px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Aaron from Malaysia wears our Men’s &lt;strong&gt;Perforated Leather Jacket.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_04_19oct2016.jpg&quot; style=&quot;width: 800px; height: 839px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Garry from Armenia wears our &lt;strong&gt;Funhouse Jumper&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_05_19oct2016.jpg&quot; style=&quot;width: 800px; height: 1013px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Bianca from Malaysia wears our &lt;strong&gt;Golden Tears Earrings&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_06_19oct2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Almos from Mozambique wears our &lt;strong&gt;First Cap&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/MagicDanceCrew_Blog_07_19oct2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Here’s me, from the UK, wearing the &lt;strong&gt;Cutiepie Earrings&lt;/strong&gt;.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Photo Credits to Garry Taiga Photography (Find him on Facebook &amp;amp; Instagram)&lt;/p&gt;\r\n','',''),(126,30,1,'Baby get BLACK!','&lt;p&gt;You know I’m forever changing my styles as there’s so many to choose from because I truly believe that every one of them deserves a go. One of my favourite styles to wear is cute &amp;amp; classy because it allows you to embrace your inner child whilst at the same time rocking the sophisticated adult look.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe way I like to play around with the two is by dressing my torso in classy wear and accessorizing over it with specs of cuteness. For example in this look I tied my hair up in two buns and added a mini backpack as a finishing touch. I chose this coin necklace to match my skirt because I’m a sucker for not mixing gold’s and silver’s together, silver on silver and gold on gold makes me ultra-happy! If you haven’t noticed, bandage effect and silver rings embedded into clothing are IN and this is why I wore this skirt, Fashion Club has their own silver ring jumpsuit available for purchase but since I’ve worn it so many times, I thought it was time to give some other items a go!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_03_24oct2016.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_02_24oct2016.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_01_24oct2016.jpg&quot; style=&quot;width: 700px; height: 1050px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(128,31,1,'Black &amp; Gold','&lt;p&gt;One of the things that I miss about my home, London, is the way that everyone dresses up for work as if they are walking down the runway. Sitting on the tube and peering around you’ll spot tons of interesting styles popping up here, there and everywhere. In Asia I’ve found that work attire is pretty casual, however, I’ll stick to my gut and dress to impress whenever I can!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_01_31oct2016.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_02_31oct2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;I picked out this fabulous threesome from Limkokwing Fashion Club today and paired it with some basic blacks, I adore how this &lt;strong&gt;coin belt&lt;/strong&gt; rewards my figure by tucking in my waist! I chose to pair the &lt;strong&gt;Triple Shell Earrings&lt;/strong&gt; and the &lt;strong&gt;Coin Belt&lt;/strong&gt; together as the shapes complement each other perfectly and as for the &lt;strong&gt;Buckle Bag, &lt;/strong&gt;I see EVERYONE carrying one whenever I’m out resulting in me getting a little jealous and purchasing one for myself!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_03_31oct2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_04_31oct2016.jpg&quot; /&gt;&lt;/p&gt;\r\n','',''),(130,32,1,'Funhouse vs Funfair','&lt;p&gt;We had a fun day with Elmira, a student at Limkokwing studying Fashion and Retailing who is also one of our newest retail angel! I asked her about her styling choice for this ultra-cute look, she simply responded saying it’s playful and fashionable and definitely suits the quirky location choice!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_01_7nov2016.jpg&quot; style=&quot;width: 700px; height: 458px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;I love how she goes against the ordinary by wearing our &lt;strong&gt;unisex Empowered Tee&lt;/strong&gt; with super gorgeous leather trousers, complementing our leather look &lt;strong&gt;Funhouse Mini backpack &lt;/strong&gt;in return! One of our newest arrivals, the &lt;strong&gt;Lace Bow Snapback&lt;/strong&gt;, works perfectly with Elmira’s short hair- so good in fact that she makes me want to go for the chop!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_02_7nov2016.jpg&quot; style=&quot;width: 700px; height: 417px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_03_7nov2016.jpg&quot; style=&quot;width: 700px; height: 1061px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_04_7nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;One of my favorite aspects of the &lt;strong&gt;Silver Ring Choker&lt;/strong&gt; is that unlike most chokers, you can’t even feel that it’s on! Due to it emitting a combination of silver and gold, you can pair it with almost anything, perfect for those last minute accessory choosing moments.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_05_7nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_06_7nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_07_7nov2016.jpg&quot; style=&quot;width: 700px; height: 394px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(133,33,1,'Fashion Club Thursday','&lt;p&gt;&lt;strong&gt;This Thursday wasn’t like any other Fashion Thursday as the Faculty of Fashion, Lifestyle and Creativity along with the Limkokwing Fashion Club team produced an extra special fashion show, exclusive only to Limkokwing University’s students. Believe it or not there was a stunning total of 38+ countries present, wearing the label with pride, all black everything of course with a touch of glamour!&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe theme was ‘Design Your Future’ and the catch was, for the first time ever, the models and performers styling and designing their very OWN sassy looks! How cool is that? I even got in with the action and styled myself, although in this photo I’ve JUST finished dancing so I’m flaunting my accessories- instead of my shiny face!&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_13_14nov2016.jpg&quot; style=&quot;width: 700px; height: 1178px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;I adored the emcees final remarks on the show:&lt;br /&gt;\r\n&lt;br /&gt;\r\n“Always dress like you’re going to see your worst enemy!”&lt;br /&gt;\r\n&lt;br /&gt;\r\nBe inspired below and see how our students and staff chose to wear Limkokwing Fashion Club, using their own creative minds!&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_01_14nov2016.jpg&quot; style=&quot;width: 700px; height: 788px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_02_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_04_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_05_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_06_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_07_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_03_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_08_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_09_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_10_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_11_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_15_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_12_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/lkwfcblog_16_14nov2016.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(138,34,1,'Beauty Queens are raving about Limkokwing University! ','&lt;p&gt;Who comes into your mind the moment we say Fashion Club? We say - &lt;strong&gt;The Bold, The Daring and The Confident.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club is no stranger to anyone that dares to be different. It is a brand that speaks to those who dares of being the best, and that’s exactly what the girls of the Miss Tourism International Pageant are all about! The 22 year old pageant that takes place on the 31st of December holds the most extensive pageantry effort in promoting tourism industries worldwide and similar to Limkokwing University, these girls in the competition are able to gather great experiences of creating friendships with others from around the globe in a short period of time!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_02_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_03_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_04_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_05_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;While the girls were at the University for a visit, they were taken into Fashion Club for a little tour. We promise we’re not lying when we say that there were LITERALLY glimmers in the girls’ eyes once they stepped into our campus store! All eyes on every little accessory, hands gliding over each and every outfit on a hanger. It’s obvious to say - these girls sure did fall head over heels with our items. Especially the painted sleeve biker jacker, shall we add! With every item worn, the confidence within them rose a little more. Although most of them were speaking to themselves in their native tongue and we couldn’t understand a single word from it, their big smiles and laughters filling the air had us convinced that Fashion Club is loved by not just Malaysians, but people of 59 other countries! Now THAT is what we call a global success!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_06_2jan2017.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_07_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_08_2jan2017.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_09_2jan2017.jpg&quot; style=&quot;width: 700px; height: 423px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Fresh, positive auras filled the place and everyone was in awe of the many beauties that walked past them. But don’t be fooled, for beauty is skin deep but knowledge goes beyond! While some of the girls have achieved their Masters Degrees and phD’s, one of them even went a little further with her Doctorate studies! Overall, we can now confirm that being a solo spokesperson for an entire country isn’t a bed of roses. It takes someone that knows no-limits into helping the lives of others, to create a change for her country. A woman who is strong, determined and positive. THAT, is someone who screams Limkokwing Fashion Club!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_10_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_11_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_12_2jan2017.jpg&quot; style=&quot;width: 700px; height: 952px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_14_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;So tell us. Do the girls remind you of yourself? Are you confident in your own skin? Are you daring enough to go forth with your dream? Most importantly… are YOU Fashion Club material?&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_13_2jan2017.jpg&quot; style=&quot;width: 700px; height: 392px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_015_2jan2017.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_16_2jan2017.jpg&quot; style=&quot;width: 700px; height: 1052px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(150,36,1,'Fashion Club\'s All Black Friday Frenzy!','&lt;p style=&quot;margin-left: 40px;&quot;&gt;Let’s look back on the Black Friday Madness that took place at the Limkokwing Fashion Club Campus Store. Students lined up for hours to grab FC’s 2016 Must-haves that were at an insane 80% discount. The store was clear within the first 3 hours- check it out!&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left: 40px;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;https://www.youtube.com/embed/qsJ5fcJu7Jg&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/p&gt;\r\n','',''),(152,35,1,'Behind the scenes with Fashion Club','&lt;p style=&quot;margin-left: 40px;&quot;&gt;Have you ever wondered&amp;nbsp;what&amp;nbsp;happens behind the scenes at a high end photo shoot?&amp;nbsp;It may surprise you to hear that in order to capture all that beauty and excitement on camera, there is a ton of prep work required. Check out how the FC team works behind the scenes of our 2017 online photoshoot.&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;https://www.youtube.com/embed/gcrttJQumrY&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/p&gt;\r\n','',''),(155,37,1,'Maximum Mayhem!','&lt;p&gt;The Fashion Industry is a booming one and the world believes that being a designer is an occupation full of glitz and glamour. Don’t get us wrong! It is. But what people DON’T see behind every smooth running fashion show decked in beautiful venues - is the blood, sweat and tears shed. Months of planning and sketching, weeks of preparation and long tiring last few days of amendments. Then again, nothing worthwhile is ever easy right?&lt;/p&gt;\r\n\r\n&lt;p&gt;While we’re only left with less than 7 days till London Fashion Week, our Limkokwing Fashion Club team and International students from the Faculty of Fashion, Lifestyle &amp;amp; Creativity are STILL working day and night preparing final touch ups to their designs. From fabrics of Indonesian Batik, to Chinese Broket, to Swaziland Lihiya - the designs conceptualize a combination of Asian and African cultures, in which represents Limkokwing University as a Global University with campuses secured in 3 different continents of the world.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_01_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_02_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_03_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\nHaving Malaysia being the University’s home country, most of the designs are also beautifully crafted with essence of Malaysian race and culture to educate others more about the country’s rich heritage. We can only imagine how nervous but excited our students must be feeling now and we wish them nothing but the best for their big day on the 17&lt;sup&gt;th&lt;/sup&gt; of February!&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_04_14feb17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_05_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_06_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_07_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_08_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_09_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_10_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_LFW_11_14feb17.jpg&quot; /&gt;&lt;br /&gt;\r\nNote to our students: As you now hectically prepare for one of your by-far biggest opportunity yet, always remember that we are very proud of you! Every mountain top is within reach if you just keep climbing. So always remember that even though life’s a climb, the view will be great!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Love,&lt;br /&gt;\r\nThe Limkokwing FashionClub Team&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(158,38,1,'T-Minus One! ','&lt;p&gt;You got that right! We’re literally ONE sleep away from seeing our student’s designs at London Fashion Week 2017 and things are already heating up pretty quick!&lt;br /&gt;\r\n&lt;br /&gt;\r\nIn conjunction with Chinese New Year, we held a little get-together with our media friends for a quick Yee Sang Toss last week, and because we were too excited for our little Fashion Week secret, we just HAD to share the great news with them on that very day too (we’re not very good at containing our excitement as you can tell).&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW 01- 16-02-17.jpg&quot; style=&quot;width: 700px; height: 410px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 02.jpg&quot; style=&quot;opacity: 0.9;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 03 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 04 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON12 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 10 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 05 16-02-17.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Creative Director, Dato Tifanee Marie Lim and team, casting models at Fashion Scout London - London\'s&amp;nbsp;biggest casting for Fashion Week.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 06 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Being the ONLY University to walk the runway, our students from the Faculty of Fashion and Lifestyle Creativity will be revealing their own designs of Asian and African culture with materials sourced by themselves from their home countries. Our International students and FashionClub team that just flew to London - have been working non-stop for the past few days with model castings, seating arrangements and they even visited the High Commissioner of Malaysia!&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;If you’re in London and want to be part of this exciting event (we know you want to), head over to Freemason’s Hall, 60 Great Queen St, London WC2B tomorrow (17&lt;sup&gt;th&lt;/sup&gt;&amp;nbsp;of Feb) at 6.30pm for our show! Everyone and ANYONE is invited, so be there or be square!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 07 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 08 16-02-17.jpg&quot; style=&quot;width: 700px; height: 512px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LFW PRESS CON 09 16-02-17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(159,39,1,'Slaying London Fashion Week!','&lt;p&gt;We’ve been for the longest of time, patiently waiting for this day and it finally came! Over 200 people packed up Freemasons’ Hall by 6.30pm on the 17&lt;sup&gt;th&lt;/sup&gt; of February to witness what is said to be, one of THE fashion collection to look out for! Being the only University to participate at Fashion Week, the crowd was curious to see what the Limkokwing students could bring to the industry. Safe to say – the multicultural designs are STILL, even till this day, the buzz of the town!&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;u&gt;ABOUT THE COLLECTION&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Made out of a combination of streetwear and luxury, the collection explores treasures engraved within African and Asian fashion heritage that represents the different cultures of Limkokwing University in a whole. From rich cross-cultural fabrics of Swaziland, Zimbabwe, Lesotho, Botswana and Iran, to extravagant accessories from Indonesia, Malaysia and more – it’s obvious that Limkokwing University IS indeed “Most International”.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;“This collection should represent where we come from,” Creative Director and University Vice President of Talent Development and Brand Creativity Dato’ Tiffanee Marie Lim muses. “Limkokwing is a very unique network. There was no way we would pass up the chance to say something about how we live and exchange ideas.”&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_slayinglfw_02_21feb17.jpg&quot; style=&quot;width: 700px; height: 311px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_slayinglfw_03_21feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_slayinglfw_04_21feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_slayinglfw_05_21feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_slayinglfw_06_21feb17.jpg&quot; /&gt;&lt;/p&gt;\r\n','',''),(165,40,1,'Bits &amp; Pieces of London Fashion Week! Day 1 &amp; 2!','&lt;p&gt;A week has flown since our breakthrough at London Fashion Week and now that the students are back, we thought we’d ask them to give us a detailed insight of what was ACTUALLY going on during the 6 days trip they had. While we could only initially tell you bits and pieces about what went down as we were not present for the show – the students had earlier agreed to record their day to day timeline in a travel diary.&amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;strong&gt;DAY 1&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;5 AM: First batch of students arrives at London Heathrow Airport with a warm welcome from London team. They were then sent to their accommodation and was given an hour to unpack. Shortly after that, the students and FashionClub team were then sent to the London Campus to prepare for model casting.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_001_28feb17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_002_28feb17.jpg&quot; style=&quot;width: 700px; height: 399px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_003_28feb17.jpg&quot; style=&quot;width: 700px; height: 436px;&quot; /&gt;&lt;br /&gt;\r\n9 AM: Campus was surrounded by 10 beautiful models who came to audition to be in our show. Designs were fitted on them to see how they carry our outfits as we normally chose models who suits our brand and character well. &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;12PM: Dato Tifanee finally arrives in our London campus! The whole team was there to welcome her with a luncheon following after her arrival.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size: 13px;&quot;&gt;2PM: Dato and students arrives at Freemasons’ Hall for another session of model castings under FashionScout in which 500 models were casting on that very same day! The models were casting according to their posing, walking, height requirement and also skin colour as we wanted to show diversity – just like what Limkokwing University is all about! &amp;nbsp;&lt;/span&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_004_28feb17.jpg&quot; style=&quot;width: 700px; height: 430px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_005_28feb17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_006_28feb17.jpg&quot; style=&quot;width: 700px; height: 449px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_007_28feb17.jpg&quot; style=&quot;width: 700px; height: 428px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_008_28feb17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;9PM: The team packs up and heads back to the London Campus for a short briefing about the models as the team were going to cast another batch the next day.&amp;nbsp;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_009_28feb17.jpg&quot; style=&quot;width: 700px; height: 1050px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;DAY 2&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;9AM: Second batch of students arrives in London and heads to London Campus to meet the team!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_010_28feb17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-size: 13px;&quot;&gt;10AM: Dato and the team takes a trip down to Belgrave Square to visit the High commissioner of Malaysia, Dato Ahmad Rasidi Hazizi.&lt;/span&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_011_28feb17.jpg&quot; style=&quot;width: 700px; height: 452px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_012_28feb17.jpg&quot; style=&quot;width: 700px; height: 440px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_013_28feb17.jpg&quot; style=&quot;width: 700px; height: 537px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1PM: Model Castings starts again all the way to 10pm with 30 of the models shortlisted. They were required to try on the students’ designs once more for Dato to determine if they were to be taken in for the show.&amp;nbsp;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_014_28feb17.jpg&quot; style=&quot;width: 700px; height: 1067px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_015_28feb17.jpg&quot; style=&quot;width: 700px; height: 501px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_content_016_28feb17.jpg&quot; /&gt;&lt;/p&gt;\r\n','',''),(167,42,1,'#outfitgoals !','&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;London Fashion Week may have flown past, but that doesn’t mean our runway pieces have! Yes, it’s NOT too good to be true. We’re bringing our Ready-To-Wear pieces – off the runway and onto your very hands. As exciting as it sounds, these items are ready for you to own and buy from our website or any of our FashionClub outlets in Malaysia and Bali!&lt;br /&gt;\r\n&lt;br /&gt;\r\nReady to go crazy over them? Take a deep breath and brace yourself. Here we go!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-left:36.0pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(169,41,1,'Bits &amp; Pieces of London Fashion Week! Day 3-5! ','&lt;p&gt;&lt;strong&gt;DAY 3&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;9AM: Time is ticking and show day is coming closer! The team makes their way to Freemasons’ Hall early this morning to work on lighting test, choreography, backstage situations and model sequences.&lt;/p&gt;\r\n\r\n&lt;p&gt;10PM: Model bookings are settled by this time and the team has a short discussion on the agenda for tomorrow as tomorrow is the last day to fully prep for the show!&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_015_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_012_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_014_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_08_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;DAY 4&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;9AM: One day away to our show and the team decided to sit down together to work on final touch-ups and discuss about model arrangements and the designs that each model will wear.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_07_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_05_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;2PM: The Limkokwing Team was then split into two separate groups after lunch. While some of them headed back to Freemasons’ hall work on hair with the International Director of Toni &amp;amp; Guy – and makeup with makeup artist Kryolan, the design team stayed back to work final amendments on the garments.&lt;/span&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_09_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;10PM: Last minute meeting was called for as tomorrow would already be THE day.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_02_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_04_1mar17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_05_1mar17.jpg&quot; style=&quot;width: 700px; height: 462px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_06_1mar17.jpg&quot; style=&quot;width: 700px; height: 1050px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;DAY 5:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size: 13px;&quot;&gt;6.30AM: Early calltime for all as they departed from their accommodation to the campus. Team briefing was then called for at 9am to do last minute alterations to the model sequence. Ironing and packing of the garments had to be done within the next hour and even without looking at pictures, you can already imagine how hectic of a time that was for them!&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_01_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;11AM: Things are heating up! Models are placed in Freemasons’ Hall for hair and makeup while our students and FashionClub team arranges the railings, shoes, model sequences and fashion board. The Fashion Scout team were also called in for a short meeting to be informed about the finale walk and which models would get more than one look. They were also briefed by our team on how to wear the accessories and garments.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_010_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_011_1mar17.jpg&quot; style=&quot;width: 700px; height: 457px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;6.30PM: Models, check! Hair and makeup, check! Lighting, check! It’s finally show time! Models get a last minute touch up, half an hour before attending to the 200 over people that were there in Freemasons’ Hall to witness the show. The show starts and lights dim as the opening model walks out. Piece by piece, the garments slide across the hall’s floor while the audience whip out their cellphones and cameras for pictures. The show ends and Creative Director, Dato Tifanee Marie Lim reveals herself to take a bow.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_016_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_017_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_018_1mar17.jpg&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_lfwdiaryD35_019_1mar17.jpg&quot; style=&quot;width: 700px; height: 311px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(173,43,1,'Meet the Crew!','&lt;p&gt;Limkokwing Fashion Club – is a fashion label that has been an unstoppable, one filled with energy for almost four years now! What was once a start-up project, is now the ONLY label created by a University with designs done by our very own students! If chic street-wear is something that you dig, then this is THE brand for you.Bold and cool, in the University’s signature black, the brand speaks urban flare, &amp;nbsp;providing you outfits that you can rock on a day to night basis, from a morning of class on campus, to a smart casual lunch meeting, even a romantic night full of glitz and glam – you can be sure that we have you covered to be the best dressed.&lt;/p&gt;\r\n\r\n&lt;p&gt;Everyday on campus, we are given the opportunities to create, and explore our creativity.&amp;nbsp;The excitement speaks to the near limitless potential for new relationships to be established and new ideas to be explored. Being in a multicultural school the students\' train of thought is broadened than usual. They are exposed to different ideologies, practices and cultures. A person is able to absorb those tendencies and apply them to any situation in their life. They become more all rounded individuals with an understanding of the global audience and what it entails. This is why our beloved sales angels have incorporated the idea of global citizenship, as it is inevitable that you will work with people of different backgrounds.&lt;/p&gt;\r\n\r\n&lt;p&gt;So, what is it that brought this close-knit team together you may ask? It’s simple. Through a common ground called – FASHION. Their dress sense is all about swag, street, fun, funk and definitely&amp;nbsp;being sexy. Here is what some of the crew members have to say about their love of each other and of course fashion. Ready to meet them? Here you go!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_23Mar17_01.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_23Mar17_02.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_23Mar17_03.jpg&quot; /&gt;&lt;/p&gt;\r\n','',''),(179,44,1,'Some of my favourite photos...','&lt;p&gt;It’s been a crazy ride on the Limkokwing Fashion Club rollercoaster!&lt;/p&gt;\r\n\r\n&lt;p&gt;This experimental label has introduced us to friends and places I never realized we’d be so privileged to meet and learn from. After our show in London we can’t wait to see what we have in store!&lt;/p&gt;\r\n\r\n&lt;p&gt;Thank you to the thousands of miracle souls out there in the world that support our initiative by shopping our products and telling your friends about what we do. We appreciate all the opportunities afforded to us by Limkokwing University and the bright minds there.&lt;/p&gt;\r\n\r\n&lt;p&gt;I was upgrading my phone recently and found some memories of the label on my travels with some of my best friends.&lt;/p&gt;\r\n\r\n&lt;p&gt;Simply from my camera roll- most of these have never been seen before, so enjoy!&lt;br /&gt;\r\n&lt;br /&gt;\r\nBy Dato’ Tiffanee Marie Lim&lt;br /&gt;\r\n&lt;em&gt;Creative Director&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;em&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_02_12April17.jpg&quot; style=&quot;width: 700px; height: 475px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_05_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_14_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_16_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_06_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_04_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_01_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_15_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_07_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_09_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_10_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_03_12April17.jpg&quot; style=&quot;width: 700px; height: 475px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_12_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_13_12April17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_SOMF_11_12April17.jpg&quot; /&gt;&lt;/em&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n','',''),(181,45,1,'Empowered!','&lt;p&gt;&lt;em&gt;Written by Tshegofatso Ludo Maphorisa&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Times are changing, the world is evolving, and what better way to stay true to yourself than to be empowered? You don’t need to be understood by everyone to be empowered. Those who understand you are enough to empower you, and help you achieve a respectable statement in life through your lifestyle. Our brand, Limkokwing Fashion Club not only promotes empowerment, but creates a platform for young talent to come onboard and unleash themselves out of the box they have been limited to. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;“What I love about Limkokwing Fashion Club, is that you don’t have to change to fit in. Rather the brand encourages you to stay true to yourself.I appreciate that being part of the Fashion Club team hasn’t stripped me of my identity but it has helped me grow more into who I am and understand that glamour is more than a soulful trait, it’s extended to my efforts to showing up appropriate, stylish and ready to take on any task.”&lt;/p&gt;\r\n\r\n&lt;p align=&quot;right&quot;&gt;&lt;em&gt;Tshegofatso Ludo Maphorisa &lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Empowered_blog_02_19may17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Empowered_blog_05_19may17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Empowered_blog_04_19may17.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Empowered_blog_03_19may17.jpg&quot; /&gt;&lt;br /&gt;\r\nVisit the new arrivals page on our website to see our new accessories and clothing that could be just what you need to complete your outfit for a glam and fun day or night out. You can also head on over to any of our stores at Publika, Solaris Dutamas, Limkokwing University Cyberjaya and KL Campuses, Seminyak Village in Bali and our showroom at Limkokwing University’s London Campus in Chancery Lane.&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n','',''),(183,46,1,'Welcoming the festive season of Ramadhan &amp; Raya with &quot;Malaysian Soul&quot;','&lt;p&gt;Limkokwing Fashion Club recently took a fresh leap forward in conquering the world of fashion with the launch of a new collection to commemorate the arrival of the Ramadhan Season. Titled “Malaysian Soul”, created by Limkokwing talented designers, the collection combines elements of cultures in Malaysia with the glamourous and youthful traits of Limkokwing University. For the first time ever, the world’s first fashion label by a University, Limkokwing Fashion Club, introduced the new collection at the 2017 Gaya Koleksi&amp;nbsp;Raya&amp;nbsp;Fashion Showcase in collaboration with Fashion Valet at the popular Publika Shopping Gallery, Black Box.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_001_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_002_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_003_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_004_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\nThe exclusive 12- piece collection portrays diverse elements from Malaysian cultures. Evolving away from the classic urban flair and various ethnic designs, the new line of dresses took inspiration from the cultural significance and community of three varied races that coexists together in Malaysia, which are the Indian –Malay, Chinese – Malay and Malay cultures.&lt;/p&gt;\r\n\r\n&lt;p&gt;Inspirations of the collection&amp;nbsp;could also be traced back to the architectural and pattern elements in Malaysia, like the mosque dome and the stripe fabrics that represent the signature prints of Malaysia. At the same time, the collection’s modern touch could be seen from the golden glitter and sequins &amp;nbsp;used in the&amp;nbsp;collection. The “Malaysian Soul” is available in black glammed up with the gold sequins to give it a more elegant, sophisticated, and classic vibes for the public.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_005_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_006_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_007_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_008_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_009_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_011_19may17.jpg&quot; style=&quot;width: 700px; height: 467px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_fcxfv_012_19may17.jpg&quot; /&gt;&lt;br /&gt;\r\nEvery one of these amazing 12 pieces are already in&amp;nbsp;our stores from 18&lt;sup&gt;th&lt;/sup&gt; of May and are also available online. So hurry up, click on our website &lt;em&gt;www.fashionclub.my&lt;/em&gt; and order your favourite pick.&lt;/p&gt;\r\n\r\n&lt;p&gt;Be the best, be the most glamourous, and shine bright during this special festive season.&lt;/p&gt;\r\n','',''),(191,47,1,'A  Perfect Blend of Culture and Fashion.   ','&lt;p&gt;&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf6-95f9-727f-3d898122749c&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;Events may come and go, but style definitely stays for long. Whether you’re rocking your boyfriend’s shirt in the morning, tantalizing the crowd with a little black dress, or standing out among the crowds by wearing a bomber jacket, style definitely provides an identity for individuals to look the best. &lt;/span&gt;&lt;/span&gt; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf_9.6.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf6-dd6d-1d92-28e28b4b5e5e&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;The same can be use to define cultures. At a general scope, culture is a tradition that has long been heralded by individuals. But, if you look closer, culture is a heritage that differentiates each individual and makes them better. &lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf2_9.6.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf7-2557-ce5e-be5ba2d51d75&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;At the recently concluded 2017 Limkokwing University International Cultural Festival, both culture and style were combined in a delicate way which was proven by the cultural garments worn by various students, honorable guests, staff, and festival attendees. Attendees were enchanted by the flow of the Indian Sarees, mesmerized by the unique Lihiya of Swaziland, and enjoyed the various traditional garments that were on display during the one-day international cultural festival. It &lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf7-583d-dc46-c42a762e3935&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;wasn’t just the students who were engulfed in the euphoria, notable guests and &amp;nbsp;performers such as Joe Filzzow and SonaOne rocked the stage in Limkokwing &lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf7-9961-c840-234f10dabd0b&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;Fashion Club’s finest garments. &lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf3_9.6.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span id=&quot;docs-internal-guid-3c9c956c-8cf7-e2a0-d5b2-85869450e9ea&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;In addition, attendees were also seen sporting glamorous outfits courtesy of Limkokwing Fashion Club, the world’s first fashion brand by a University which highlighted the brand’s Glam Zone area at the festival. Throughout the cultural festival, people come together to create a sense of unity through diversity that further cemented Limkokwing University’s status as the Most International University in Asia.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf6_9.6.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf4_9.6.2017.jpg&quot; style=&quot;width: 700px; height: 868px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_cf5_6.9.2017.jpg&quot; style=&quot;width: 700px; height: 781px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span id=&quot;docs-internal-guid-eded2c19-8cf8-1919-1478-58524cb2674a&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;Vist &lt;/span&gt;&lt;a href=&quot;http://www.fashionclub.my&quot; style=&quot;text-decoration:none;&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(5, 99, 193); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;www.fashionclub.my&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 12pt; font-family: Tahoma; color: rgb(0, 0, 0); background-color: transparent; font-variant-ligatures: normal; font-variant-position: normal; font-variant-numeric: normal; font-variant-alternates: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt; or visit Limkokwing Fashion Club stores at the Cyberjaya campus; Publika, Solaris; Seminyak Village, Bali; Tsuites, Bali; and London to join the sickest crew in town!&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(196,48,1,'Eat, Sleep, Design: Malaysian Soul ','&lt;p&gt;If you’re an aspiring designer or have a passion for fashion, then you’ll know that the Limkokwing Fashion Club have recently launched the ‘Malaysian Soul’ collection to celebrate glamour at Ramadan and Raya.&lt;/p&gt;\r\n\r\n&lt;p&gt;At the Fashion Club, we want to inspire YOU. So, we have created an online mood board for our Malaysian&amp;nbsp;Soul collection to show you the process of designing groundbreaking garments.&lt;/p&gt;\r\n\r\n&lt;p&gt;We know, you’re welcome!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The collection focuses on highlighting your curves and accenting your figure with gold glitter and sequins. The collection provides the ultimate glamour whilst having a distinctive edge! This mood board encompasses the creative design sketches of the collection as well as the display in stores.&lt;/p&gt;\r\n\r\n&lt;p&gt;So, get designing and get sharing, us the hashtag #LKWFashionClub to share your designs, with us.&amp;nbsp;&lt;/p&gt;\r\n','',''),(210,50,1,'A walk on the wild side','&lt;p&gt;It\'s a blazing hot Saturday, 4 p.m in KL but Kitana Gu is still fresh-faced, bright eyed, and energetic. It’s been 2 hours of non-stop shooting with professional photographer, Emest Lee and the model still maintains her mad swag and rocks it well despite the hot weather.&lt;/p&gt;\r\n\r\n&lt;p&gt;She breaks for a while to take a sit, sips onto a purifying-looking orange drink with her feet curled up beneath her, and catches up with me.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&quot;What swag?&quot;&amp;nbsp;she chuckles , &amp;nbsp;&quot;I guess it’s all about confidence, I have always been an advocate of women\'s confidence. Once you get it you can never go wrong with anything.&quot; she said.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_awalkonthewildside_05_7JULY17.jpg&quot; style=&quot;width: 700px; height: 1050px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Brunette, fit, and beautiful, Kitana’s persona is bold and comes off in all she does. The 24 year old mixed Korean-Uzbek is currently taking her Bachelor of Arts in Fashion and Retailing at Limkokwing University.&lt;/p&gt;\r\n\r\n&lt;p&gt;“Fashion is fun and fierce. I had to transform my character to prepare myself for my future career,” she says.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhen asked how she started modelling, Kitana describes her break . “I was just walking in the Campus Plaza on a normal lunch break, and one girl approached me to shoot for the University’s fashion brand, Limkokwing Fashion Club. I agreed of course, but little did I know that this would be my big break into modelling.”&lt;/p&gt;\r\n\r\n&lt;p&gt;She has since graced numerous catwalks at Russia and Malaysia fashion weeks for the brands Marc Jacob, XIXILI, LOGO, ZALORA, L’oreal , Swarowski &amp;nbsp;and many more making her definitely a fashionista and model-to-watch out for in the future!&lt;/p&gt;\r\n\r\n&lt;p&gt;Check out more of the “Native Indian American Inspired” shots below, with the beautiful Kitana in our fun beaded tasseled top.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_awalkonthewildside_02_7JULY17.jpg&quot; style=&quot;width: 700px; height: 984px;&quot; /&gt;&lt;br /&gt;\r\nThis shoot balanced elegance, light and glamour within a powerful Native American Indian theme that is new for the Fashion Club.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_awalkonthewildside_03_7JULY17.jpg&quot; /&gt;&lt;br /&gt;\r\nPhotographer Emest Lee says, &lt;em&gt;“I love how the outfit matched the nature and the setting of the shoot” &lt;/em&gt;and credits Kitana for her passion for modeling, professionalism and pushing the boundaries!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_awalkonthewildside_04_7JULY17.jpg&quot; /&gt;&lt;br /&gt;\r\nKitana is fun loving, active and has a love for creativity! Since modelling at the Fashion Club she has grown in confidence and loves being able to create influential images where she feels empowered, stylish and glamorous.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Written by Emily Darnley&lt;br /&gt;\r\nPhoto Credits to Emest Freezo Photography&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(226,51,1,'Reminiscing a Magical Week','&lt;p&gt;&lt;sub&gt;&lt;em&gt;By Dato’ Tiffanee Marie Lim&lt;/em&gt;&lt;/sub&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;A few weeks ago as a birthday gift to myself, with much badly-managed guilt, I literally took my first holiday! It was a perfect escape, with my birthday falling on the same day as Eid.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nIt had been a mad couple of months and while glamourous-looking, travelling alone all the time just makes you wish and wish you were with someone you love.&lt;br /&gt;\r\n&lt;br /&gt;\r\nI went to London to sleep in my own bed, in my own little home, looking forward to having my best friends Lily and Michael stay.&lt;br /&gt;\r\n&lt;br /&gt;\r\nFind attached pictures of some of the highlights&amp;nbsp;of my short stay, during which I basically wore Limkokwing Fashion Club every day. I brought pieces from Malaysian Soul our Raya Collection and styled them with jeans, shimmied into a LFW runway piece Pedram made me believe fit, and sprinkled gold dust on everything!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_01a_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_01_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;em&gt;Visiting the Limkokwing University London campus.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_02_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\nWith my bestie since Roedean School 15 years ago, Lily.&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_03_1aug2017.jpg&quot; style=&quot;width: 700px; height: 982px;&quot; /&gt;&lt;br /&gt;\r\nLily and her love bug Michael (wearing Limkokwing Fashion Club Asymmetric Tee).&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_04_1aug2017.jpg&quot; style=&quot;width: 700px; height: 484px;&quot; /&gt;&lt;br /&gt;\r\nLooking out over Vauxhall Bridge in Fashion Club LFW Runway.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_06_1aug2017.jpg&quot; style=&quot;width: 700px; height: 904px;&quot; /&gt;&lt;br /&gt;\r\nLily wearing the Joyce, from Malaysian Soul&lt;/em&gt;.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_08_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_07_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;em&gt;Lunch with blonde baby mama Maija, one of the youngest VPs in equity trading at a major bank and major foodie​.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_10_1aug2017.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_09_1aug2017.jpg&quot; style=&quot;width: 700px; height: 902px;&quot; /&gt;&lt;br /&gt;\r\nFashion Club faves David, Kat &amp;amp; Steven - pillars of the label!&lt;/em&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nWhat an awakening of love.&lt;br /&gt;\r\nI miss these stolen moments so much!&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(231,52,1,'Limkokwing Leads In Style At Borneo Fashion Week 2017','&lt;p&gt;The worlds of culture, modernism, and fashion clashed harmoniously once again through the illustrious collections presented by Limkokwing University at Borneo Fashion Week 2017. Held in Kuching, Sarawak, Limkokwing University combined looks from the recently released Malaysian Soul collection with edgy-cultural pieces seen at the 2017 London Fashion Week. During the 7th – 9th of July shows, Limkokwing University showed that fashion should not be bound by rules and methods taught in the classrooms, but it should be the fruit of limitless creativity. The beautiful &amp;nbsp;and talented Emily Darnley &amp;nbsp;shares with us how Limkokwing took over Borneo Fashion Week 2017!&lt;/p&gt;\r\n\r\n&lt;div style=&quot;position:relative;height:0;padding-bottom:56.25%&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;https://www.youtube.com/embed/6FXtXkEXYDs?ecver=2&quot; style=&quot;position:absolute;width:100%;height:100%;left:0&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n','',''),(234,53,1,'Electric Run 2017. Recharged Edition Powered By Limkokwing University.','&lt;p&gt;&lt;span style=&quot;font-family: \'YouTube Noto\', Roboto, arial, sans-serif; font-size: 13px; background-color: rgb(246, 246, 246);&quot;&gt;Limkokwing University of Creative Technology, as Malaysia’s coolest university, returning as sponsor for Electric run 2017.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;font-family: \'YouTube Noto\', Roboto, arial, sans-serif; font-size: 13px;&quot; /&gt;\r\n&lt;span style=&quot;font-family: \'YouTube Noto\', Roboto, arial, sans-serif; font-size: 13px; background-color: rgb(246, 246, 246);&quot;&gt;Electric run is Malaysia\'s fun and exciting event that Limkokwing didn\'t miss this year. We enjoyed the unique course lands and entertainment lined up for the night.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div style=&quot;position:relative;height:0;padding-bottom:56.25%&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;https://www.youtube.com/embed/U3JM5zDqW8g?ecver=2&quot; style=&quot;position:absolute;width:100%;height:100%;left:0&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n','',''),(235,54,1,'Buckle Up Buttercup','&lt;p&gt;You know what? Recently I\'ve found myself attending a lot of indoor events and since I\'ve lived in Malaysia- I\'m not really fully prepared for ice cold spaces anymore.&lt;/p&gt;\r\n\r\n&lt;p&gt;This is when items such as the&amp;nbsp;&lt;strong&gt;Buckle Bomber Jacket&amp;nbsp;&lt;/strong&gt;come in handy, it looks pretty heavy but in my opinion it\'s actually quite cool and lightweight.&lt;/p&gt;\r\n\r\n&lt;p&gt;Being a total shopaholic, I find it frustratingly hard to find WOW pieces in malls so when this jacket was released I was super happy as the buckle details and embroidered back look runway ready YET it\'s priced pretty reasonably for what it is.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_bub3_7.08.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;When you\'re pairing a statement skirt and jacket, it\'s a no-go to choose a fussy top so this&amp;nbsp;&lt;strong&gt;Essential Volcano Print Tee&lt;/strong&gt;&amp;nbsp;works perfectly- especially since the material is easy going and comfy to wear.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_bub4_7.08.2017.jpg&quot; style=&quot;width: 700px; height: 400px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;When it comes to fashion aesthetics, I\'ve always been attracted to the Harajuku/ skater style so these&amp;nbsp;&lt;strong&gt;Circle Ring Earrings&amp;nbsp;&lt;/strong&gt;are&amp;nbsp;a must have. I have a limit when it comes to mix matching gold and silver too and since the jacket has icy silver zips- silver earrings it is!&lt;/p&gt;\r\n\r\n&lt;p&gt;I hope to see you soon Malaysia,&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Forever in love,&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Kat from the U.K&lt;/p&gt;\r\n','',''),(269,49,1,'London Mind, Malaysian Soul.','&lt;p&gt;Being a London model, and modelling for Limkokwing is always a pleasure, especially when you get to debut The Fashion Club’s first Raya Collection.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_1_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThis collection beautifully honors the season of Ramadan and incorporates the essential, glamourous elements that Limkokwing is notorious for.&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_3_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 1020px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;‘Malaysian Soul’ is an exclusive, 12 piece collection that intertwines the cultural elements of modern Malaysia. The official photoshoot continued to embody the collections’ themes of celebration and empowerment.&amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_6_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;I thoroughly enjoyed my day shooting for the collection and to have the wonderful opportunity to wear the variety of classy, modern and beautifully made pieces. Each piece in the collection holds a special place in our hearts at the Fashion Club office, and we hope they hold a special place in your hearts, too.&amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_7_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The pieces in this collection are unlike any that I have worn before and they are true to the Fashion Club’s style, but provide a modern change for the brand. I am planning to wear some of these stunning pieces to upcoming events and occasions- they’re too beautiful not to!&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_9_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;So, why not unleash your inner queen and visit the Publlika store in KL or the Limkokwing University Campus store to see the innovative collection for yourself!&amp;nbsp;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/LMMS_8_29.06.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;At The Fashion Club, we want you to feel like you’re on the runway, every day. Pre-order your Malaysian Soul favourite pieces&amp;nbsp;&lt;a href=&quot;https://fashionclub.my/index.php?route=product/category&amp;amp;path=91&quot;&gt;https://fashionclub.my/index.php?route=product/category&amp;amp;path=91&lt;/a&gt; .&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;By Emily Darnley&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(273,56,1,'Get Your Sequin On!','&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;Written by Adilya&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;Sequin fever got us feeling &lt;/span&gt;&lt;span style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;like it was the 70’s again!My girls and I decided to style ourselves with the new Disco Fever collection by Limkokwing Fashion Club inspired by this latest trend and boy did we have massive fun at the carousel park.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;It was sunny and the weather was absolutely perfect for our day out! We bought ourselves mixed berry heart shaped lollipops and had some ice cream at the park to cool ourselves down.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/sequinblog1.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;My girls and I, jumped on the merry-go-round, let our hair down, shared our laughter and felt young and free all the way throughout the rides.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;One of our &amp;nbsp;favorite spots in the carousel park was the Candy World. It is built with a dreamy world of candy concept, displayed with colorful balloons, ice cream walls and cupcake chairs.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;And obviously, we took a lot of photos! Most of the shots were amazing as our outfits were an absolute stand out matching along multiple color popping backgrounds at the park.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;Now all that brings me to the part of unveiling&amp;nbsp;our new rocking edge looks with glistering sequin fabrics! Speaking of sequin fabrics, you’ve got to see how Valeriya, Alina and I shimmered ourselves.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/sequinblog32l.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;color: rgb(34, 34, 34); font-size: 13px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;I decided to be as casual as possible but at the same time not letting go of the sequined theme. Hence, I wore the Fashion Breathes collection’s over-sized Tee and styled it like a dress along with the all new eye-popping Disco Fever Buckled Clutch.&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/sequinblog3.jpg&quot; style=&quot;font-family: verdana, sans-serif; width: 700px; height: 500px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;Valeriya was wearing a Polo-Tee from Essential Collection which she had cropped by herself to style it along a skinny jeans covered partially by the all new Disco Fever Paneled Skirt.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: verdana, sans-serif; font-size: small;&quot;&gt;\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;‘This outfit revealed my inner-fun self&amp;nbsp;as I was extremely comfortable with the material and honestly speaking,&amp;nbsp;I have&amp;nbsp;never felt so confident enough to rock sequins!’ said Valeriya.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;Alina &amp;nbsp;looked bold and astonishing wearing the Disco Fever over-sized Hoodie. Why do I say astonishing? Because it’s FULL OF SEQUINS! And she never looked better!&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/sequinblog42l.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;With a big smile on her face, Alina exclaimed, ‘The best part of a girl’s day out is the outfit to fit Instagram worthy photos and it feels amazing to shine bright like a diamond in real life!’&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;Cheers to having some dazzles in your wardrobe girls!&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;m_4224871219440473419gmail-m_1750852641232607008ydp10e1f290yiv4149362984msonormal&quot; style=&quot;font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 13px; margin-bottom: 16pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Tahoma, sans-serif;&quot;&gt;You can now pre-order our new Disco Fever collection&amp;nbsp;at any Limkokwing Fashion Club Retail Stores or right here &lt;a href=&quot;https://fashionclub.my/index.php?route=product/category&amp;amp;path=91&quot;&gt;https://fashionclub.my/index.php?route=product/category&amp;amp;path=91&lt;/a&gt; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_extra&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;\r\n&lt;div class=&quot;gmail_quote&quot;&gt;\r\n&lt;blockquote class=&quot;gmail_quote&quot; style=&quot;margin: 0px 0px 0px 0.8ex; border-left-width: 1px; padding-left: 1ex;&quot;&gt;&amp;nbsp;&lt;/blockquote&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n','',''),(274,55,1,'Kuala Lumpur Fashion Week 2017 ','&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Part I – GLAM SQUAD&lt;/p&gt;\r\n\r\n&lt;p&gt;The year’s most anticipated fashion event, the Kuala Lumpur Fashion Week Ready to Wear 2017 (KLFW RTW) was fun! Fashion aficionados from all over Malaysia flocked the Centre Court of Pavilion KL from the 16&lt;sup&gt;th&lt;/sup&gt; to 20&lt;sup&gt;th&lt;/sup&gt; of August. Organised by Andrew’s Models, the coveted fashion affair showcased various ready to wear designs from the hottest names in Malaysia fashion scene and we are proud of many of our Limkokwing students from KL and all the way Cambodia as well as our alumni who showcased their creative designs throughout the fashion week! Of course, we were there to show our utmost support &amp;lt;3!&lt;/p&gt;\r\n\r\n&lt;p&gt;And, obviously our squad brought the “Fashion breathes on the street not the runway” slogan to life! Decked in the decadence London Fashion Week 2017 collection by Limkokwing Fashion Club, the glamour squad turned the street of Bukit Bintang into their own catwalks.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The fun did not stop only there as the troop attended fashion shows by legendary names from local fashion scene but also &amp;nbsp;Limkokwing alumni and friends, such as Dato’ Sri Dr Farah Khan, Melinda Looi, Sazzy Falak and many more. Congratulations for all our friends and amazing collections.&lt;/p&gt;\r\n\r\n&lt;p&gt;Limkokwing Fashion Club, as the world’s first fashion label by a university, provides physical and online retail platforms for our young designers.It is a brand where we can go as creative as we can by thinking out of the box.&lt;/p&gt;\r\n\r\n&lt;p&gt;See below for some of our favourite looks from the Farah Khan’s Show and also our squad Fashion OOTD shots taken during the Kuala Lumpur Fashion Week Ready to Wear 2017! &amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs01_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_mainpic_02_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;sub&gt;Kuala Lumpur Fashion Week Ready to Wear Celebrates its Fifth Anniversary at Pavilion in Bukit Bintang with five highly anticipated days of fashion from 16th to 20th August 2017&lt;/sub&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs02_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\nStanding Tall in Style with Malaysian International Fashion Designer Amir Luqman&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs16_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs03_5.08.2017.jpg&quot; /&gt;&lt;br /&gt;\r\n&amp;nbsp;With Jesrina Arshad the Founder &amp;amp; CEO, PurelyB.com&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs05_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs06_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs07_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs07_6.08.2017.jpg&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs04_5.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs08_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\nLimkokwing University Students Attending Dato’ Sri Dr Farah Khan’s 10 year celebrate show.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs15_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;br /&gt;\r\nSefie with our creative director Dato’ Tiffanee&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs11_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs12_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs09_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs13_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_qs14_6.08.2017.jpg&quot; style=&quot;width: 700px; height: 445px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(276,57,1,'KL Fashion Week 2017 - Part 2 – AirAsia Runway Ready Designer Search 2017','&lt;p&gt;AirAsia Runway Ready Designer Search 2017 was back again this time for the third season with an expansion of talent search across all 10 Asean countries; Indonesia, Thailand, Singapore, the Philippines, Vietnam, Brunei, Myanmar, Laos, Cambodia as well as from Malaysia to provide a platform for young aspiring designers from around the region to showcase their talents and help catapult them into the fashion industry.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Limkokwing Students Recognized as South East Asia’s Best Young Designers! &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our university is amazing because on campus everyday they are new people to meet and new accomplishments taking place. At the recent Kuala Lumpur Fashion Week, one of the highlights (if not the highlight) of the week was the Air Asia Runway Ready Designers Search which sought to bring South East Asia&amp;nbsp; best young talent to the fore and launch new collections and new opportunities on the massively influential Fashion Valet online store.&lt;/p&gt;\r\n\r\n&lt;p&gt;It was truly an inspiring show to watch but more importantly, we couldn’t be more proud that Limkokwing dominated the competition! A panel of industry heavyweights including Founder of Kuala Lumpur Fashion Week, Andrew Tan, CEO of Air Asia Aireen Omar and Fashion Valet’s darling Vivy Yusof, travelled to all 10 ASEAN countries and combed each nation to find two worthy representatives that would fly to Kuala Lumpur to show, and hopefully win a ridiculously hot prize package, including the opportunity to launch their very own label with a grant of RM25,000 and a guaranteed space to retail on fashionvalet.com, obviously one of South East Asia’s most&amp;nbsp; dynamic startups reaching millions of people. Limkokwing is the only university with such a presence throughout ASEAN with companies in 30 countries and we couldn’t be more proud of our 3 finalists Malaysian Phynix and Cambodian Leach and Kong who were recognized to be the countries best. Each had their own personalities and brought their own flavors and their characters to the country’s runway which we all felt was an unbelievable proud and brave moment.&lt;/p&gt;\r\n\r\n&lt;p&gt;The competition was super extreme because KL’s luxury retail destination landmark Pavilion was flooded with people looking to see who next year’s hot name would be. Ultimately Tran Thi Tu from Vietnam won but our boys put up a strong light, with the judges buzzing with praise for all 3.We can’t wait to see what these boys have in store and we are still proud that we retain our position as South East Asia’s most profile design university! We think it was a super tough competition with ASEAN’s best 20 young designers judged by a panel 20 industry names. Congratulations to the designers.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_01.jpg&quot; style=&quot;width: 700px; height: 443px;&quot; /&gt;&lt;br /&gt;\r\n&lt;em&gt;3 of our Limkokwing students who reached the top 20 finalist of this year competition. Malaysia‘s Phynix Tan Pek Han and Leach Savuthpenghuy and Kong Sothea from Cambodia.&lt;/em&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nSee below to find out their amazing collection in AirAsia Runway Ready Designer Search 2017.&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_02.jpg&quot; style=&quot;width: 700px; height: 407px;&quot; /&gt;&lt;br /&gt;\r\nJudges: (From Left) &amp;nbsp;Founder of Andrew Model Agency Andrew Tan, Crowned Winner of the Air Asia Runway Read Designer Search Tran Thi Tu from Vietnam, CEO of Air Asia Aireen Omar and Founder of Fashion Valet,&amp;nbsp;Vivy Yusof.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_03.jpg&quot; style=&quot;width: 700px; height: 416px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_04.jpg&quot; style=&quot;width: 700px; height: 395px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_05.jpg&quot; style=&quot;width: 700px; height: 466px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_06.jpg&quot; style=&quot;width: 700px; height: 432px;&quot; /&gt;&lt;br /&gt;\r\nAnd of course but not least Wefie with our Creative Director for showing loves to supporting our students&amp;nbsp;.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/blog_klfw_airasia_190917_07.jpg&quot; style=&quot;width: 700px; height: 418px;&quot; /&gt;&lt;br /&gt;\r\nExecutive Director and Chief Executive Officer Aireen Omar (In the middle) with Our Winner Students and Airasia Team Crew.&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n','',''),(280,58,1,'It\'s a Tie Vibe ','&lt;p&gt;&lt;strong&gt;“If you can’t be better than your competition, just dress better.”&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp;– Anna Wintour.&lt;/p&gt;\r\n\r\n&lt;p&gt;In a world of concrete jungles, rocky pavements, and tropical weather, men often takes fashion as an afterthought. But not for Murat from Kazakhstan! When we met him during one of his usual sojourn to Kuala Lumpur, Murat turned Kuala Lumpur to his own runway and made heads turned with Limkokwing Fashion Club’s Designer Oversized Shirt and Essential Graffiti Tie!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/tieblog_01_25.07.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Creative Multimedia student identified himself closely with Limkokwing Fashion Club, because of the street-wear fashion that comfortably show off his height and toned physique.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/tieblog_02_25.07.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nAlong with his brother, Ahmediyar, he said that “We love the designs of Limkokwing Fashion Club as they really match our styles!”.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/tieblog_03_25.07.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;To find out more about stunning designs of Limkokwing Fashion Club, visit &lt;a href=&quot;http://www.fashionclub.my/&quot;&gt;www.fashionclub.my&lt;/a&gt; or visit our stores at Cyberjaya, Bukit Bintang, Bali, and London! Put some springs on your steps with our collections and make the streets your own runways!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/tieblog_04_25.07.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','',''),(284,59,1,'Pavilion Elite Fashion Night Out','&lt;p align=&quot;center&quot;&gt;&lt;em&gt;What you wear is how you present yourself to the world, especially today when human contacts go so fast. Fashion is instant language. – Miuccia Prada&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;em&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/pefn_04_10.10.2017.jpg&quot; /&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nFashion and style roars beautifully in the heart of Kuala Lumpur’s tourism district with a touch of Limkokwing University’s magic. Fashion students from Limkokwing University provided the glamour touches to one of Pavilion’s celebration of flairs, the Pavilion Elite’s Fashion Night Out on September 28&lt;sup&gt;th&lt;/sup&gt;, 2017, that brought together fashionistas, social media influencers, socialites, business partners, and media for a stylish night out.&amp;nbsp;&lt;br /&gt;\r\nAt the event, 4 students from the Faculty of Fashion and Lifestyle Creativity put creative spins to the Pavilion Elite’s Fashion Night Out official T-shirt. They definitely elevate the looks into higher fashion stratospheres.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/pefn_05_10.10.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Adilya Botabayeva&lt;/strong&gt;, an international student from Kazakhstan, said ‘It was a pleasure to be a part of this show and we also learned how to create something unique in a short period of time! ’ as she was among the four chosen students to participate in the event and communicate in the language of fashion.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/pefn_07_10.10.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nStudents from Limkokwing University was also honored and excited in meeting famous fashion influencers and celebrities as a part of their industrial training experience.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/pefn_02_10.10.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nThey had fun witnessing the models flaunt down the runway clad in the most recent fall and winter gathering from Pavilion Elite partaking brands Levi\'s, Bric\'s Milano, Kenneth Cole, Esfolar, Bonia, Chaps, Carlo Rino and Lorna Jane and JD Sports along with performances by the Funky Fresh dance crew.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/pefn_03_10.10.2017.jpg&quot; style=&quot;width: 700px; height: 500px;&quot; /&gt;&lt;/p&gt;\r\n','',''),(286,60,1,'Floating with the Butterflies','&lt;p align=&quot;center&quot;&gt;&lt;br /&gt;\r\n&quot;I don\'t do fashion. I am fashion.&quot; - Coco Chanel&lt;/p&gt;\r\n\r\n&lt;p&gt;Getting dressed and looking your best everyday can be daunting. It can be difficult to look &quot;effortless&quot;, but really all we need are pieces we can rely on to make us feel smart and confident in our own skin.&lt;br /&gt;\r\nWe found a perfect match when Balzhan Gabdrakhimova put on our latest bomber.&amp;nbsp; She beamed with love at the sight of it and hasn\'t stopped receiving compliments since. Matched in heaven!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_02_24oct17.jpg&quot; style=&quot;width: 700px; height: 450px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_03_24oct17.jpg&quot; style=&quot;width: 700px; height: 525px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nBalzhan is a student, model, and a rising star in the world of blogging in Kazakhstan. Despite being a semester 5 student of Business Administration at Limkokwing University, Balzhan cannot deny her first love, fashion. At Malaysia\'s most globalised university, her relationship with fashion became deeper after being introduced to the Limkokwing Fashion Club brand.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&quot;Limkokwing Fashion Club is the first brand inspired me so much, as the clothes designed by students like me. It makes me feel I can do anything and achieve my goals like nothing is impossible. I became a Fashion Club fan since joining this University and I have never found designs with so much fun in every piece from other places.&quot;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/Blog_04_24oct17.jpg&quot; style=&quot;width: 700px; height: 450px;&quot; /&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe designs of the label suit her bubbly personality perfectly!&amp;nbsp;&quot;The butterfly bomber I wore at this weekend turned so many heads! These days I like wearing black everyday because I want to wear Fashion Club! The brand has made black happy, fun and glamorous!&quot;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;You can now purchase our new Butterfly Forest Bomber Jacket at any Fashion Club retail stores or right here.&lt;/p&gt;\r\n','',''),(291,61,1,'Crown Ready Alexis Sue Ann','&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;font face=&quot;verdana, sans-serif&quot;&gt;Our friend, 22-year old Alexis Sue Ann is a true definition of a quadruple threat. She shines on&amp;nbsp;TV and radio, excels&amp;nbsp;in event hosting, and is also a stunning model. She lives by the saying, “Choose a job you love, and you’ll never have to work a day in your life.” As a confident and vocal young lady, we believe that she has the complete package to sweep to grab the Miss Universe Malaysia title that she is running for this year.&amp;nbsp;&lt;/font&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;font face=&quot;verdana, sans-serif&quot;&gt;Alexis is one of our brands\' favorite members&amp;nbsp; and she enjoys rocking our proudcts. She&amp;nbsp; always chooses our unique pieces to complete her looks for shoots, red carpet events and glamorous&amp;nbsp;parties.&lt;/font&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;font face=&quot;verdana, sans-serif&quot;&gt;Here are some of her favourite Fashion Club pieces:&lt;/font&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;span style=&quot;font-family: verdana, sans-serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/missuniverse18_01_11jan18.jpg&quot; style=&quot;width: 700px; height: 912px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/missuniverse18_05_11jan18.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/missuniverse18_03_11jan18.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/missuniverse18_02_11jan18.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/missuniverse18_04_11jan18.jpg&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;span style=&quot;font-family: verdana, sans-serif;&quot;&gt;People who choose Fashion Club are always go getters!&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;font face=&quot;verdana, sans-serif&quot;&gt;We are proud of our friend Alexis\' success thus far at Miss Universe Malaysia 2018 and we behind her every step of the way!&lt;/font&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.800000190734863px;&quot;&gt;&lt;font face=&quot;verdana, sans-serif&quot;&gt;Go get the crown girl!&lt;/font&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;font-family: verdana, sans-serif; font-size: small;&quot;&gt;Catch her strut the runway&amp;nbsp;&lt;/span&gt;&lt;span class=&quot;aBn&quot; data-term=&quot;goog_475327003&quot; style=&quot;font-family: verdana, sans-serif; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: rgb(204, 204, 204); position: relative; top: -2px; z-index: 0;&quot; tabindex=&quot;0&quot;&gt;&lt;span class=&quot;aQJ&quot; style=&quot;position: relative; top: 2px; z-index: -1;&quot;&gt;tonight&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: verdana, sans-serif; font-size: small;&quot;&gt;&amp;nbsp;online on Hurr.tv&lt;/span&gt;&lt;/div&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;&lt;/div&gt;\r\n','','');
