INSERT INTO `oc_simple_blog_article_description_additional` VALUES (13,1,'&lt;p&gt;&lt;strong&gt;Creative Director of Limkokwing Fashion Club, Dato’ Sri’ Tiffanee Marie Lim.&lt;/strong&gt;&lt;/p&gt;\r\n'),(20,1,'&lt;p align=&quot;center&quot;&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Rumor has it that lucky members of the public have been receiving some &lt;/span&gt;&lt;strong style=&quot;line-height: 1.6em;&quot;&gt;EXTRA&lt;/strong&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt; special attention lately as Limkokwing Fashion Club has gone Fashion Show cray cray and branched out to all over Malaysia to bring our vibe right to your doorstep.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;br /&gt;\r\nIt gives us great pleasure to gracefully invade your local malls with our most prized possessions that range from our student models from over 10 different countries, our talented DJ duo, dancers that can take you on a story of a lifetime and not forgetting our student stylists that use their magic to lure you over to watch our shows!&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;Now does that sound good to you?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Take a look at our appearances made in &lt;strong&gt;IOI City Mall &lt;/strong&gt;Putrajaya and &lt;strong&gt;Dataran Pahlawan Mall&lt;/strong&gt; in the beautiful Malacca! Oh and did I mention that we have a &lt;strong&gt;stunning campus in Malacca&lt;/strong&gt;? One of the benefits of being a Limkokwing Student is the chance to travel there for a short and sweet one month of madness on our Global Campus programme, how cool is that!&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Now a new post wouldn’t be complete without our &lt;strong&gt;NEW ARRIVALS &lt;/strong&gt;so check out some of our models attire below and find them online or at any of our stores!&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Ps: We will be hitting the streets of Malacca again soon this month, so give us a shout if you’re in town!&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;br /&gt;\r\n&lt;strong&gt;IOI Mall, Putrajaya&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_11.jpg&quot; style=&quot;width: 1000px; height: 685px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_10.jpg&quot; style=&quot;width: 1000px; height: 666px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_12.jpg&quot; style=&quot;width: 1000px; height: 651px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Malacca on the move!&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_02.jpg&quot; style=&quot;width: 1000px; height: 784px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_04.jpg&quot; style=&quot;width: 1000px; height: 809px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_03.jpg&quot; style=&quot;width: 1000px; height: 687px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_09.jpg&quot; style=&quot;width: 1000px; height: 714px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_01.jpg&quot; style=&quot;width: 1000px; height: 1505px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_05.jpg&quot; style=&quot;width: 1000px; height: 1500px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Our Show to Malacca&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_06.jpg&quot; style=&quot;width: 1000px; height: 671px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_08.jpg&quot; style=&quot;width: 1000px; height: 696px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_07.jpg&quot; style=&quot;width: 1000px; height: 710px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_13.jpg&quot; style=&quot;width: 1000px; height: 667px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/Web_14.jpg&quot; style=&quot;width: 1000px; height: 667px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n'),(21,1,'&lt;p align=&quot;center&quot;&gt;The reasoning behind my admiration is due to my biggest guilty pleasure being a massive addict to hopelessly watching African wildlife documentaries &lt;strong&gt;WHENEVER&lt;/strong&gt; I get the chance!&lt;br /&gt;\r\n&lt;br /&gt;\r\nRumor had it that in Africa &lt;strong&gt;the President of Botswana, Ian Khama&lt;/strong&gt;, was going to visit our very own campus. We all couldn’t believe it and were jumping with excitement, yet at the same time jealous that we wouldn’t get the chance to be there an experience the proud moment along with our fellow African students and staff. Nights before the event, I received an email that took me by surprise; “Flight itinerary to Africa?” I questioned out loud to myself- was someone tricking me or was this email for real?! Indeed it was for real and shortly after receiving my roles I jetted off on a rollercoaster of a journey all the way to &lt;strong&gt;the blissful Republic of Botswana&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Upon arrival I was pleasantly surprised with the way that &lt;strong&gt;Botswana has transformed&lt;/strong&gt; as it was in fact one of the poorest countries in the world around forty years ago- something that you wouldn’t believe now! Luckily for us, the campus was in tip top condition and the exhibitions that the students and staff had prepared &lt;strong&gt;exceeded our expectations&lt;/strong&gt;, especially the &lt;strong&gt;disabled facilities which they told us were the best in Botswana&lt;/strong&gt;! I spent my days preparing the fashion club booth, photography lab and training the choir for the event and THANKFULLY they were all complete and ready for the special day to arrive.&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;I even managed to squeeze in a research trip to some of the local malls and hit bullseye when I found the perfect location for &lt;strong&gt;a new Limkokwing Fashion Club store&lt;/strong&gt; at &lt;strong&gt;Airport Junction in Gabarone&lt;/strong&gt;. How exciting is that!&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe President’s visit was a true success as he shared his love for the university and thanked us for making the governments money, &lt;strong&gt;money well spent&lt;/strong&gt;. His Excellency visited &lt;strong&gt;the&lt;/strong&gt; &lt;strong&gt;Limkokwing Fashion Club booth&lt;/strong&gt; where I presented him with a limited edition cap, &lt;strong&gt;made by our student alumni&lt;/strong&gt;, which featured a &lt;strong&gt;colourful jeweled Botswana Flag&lt;/strong&gt; which made him break out into a smile- &lt;strong&gt;SUCCESS&lt;/strong&gt;! The President gave a speech to conclude his visit in which he said;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;“Limkokwing University of Creative Technology is a jewel of an institution that we should all be proud of”.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;Here are some highlights from my trip…&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_12.jpg&quot; style=&quot;width: 1025px; height: 1367px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_11.jpg&quot; style=&quot;width: 1025px; height: 769px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_09.jpg&quot; style=&quot;width: 1025px; height: 711px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_07.jpg&quot; style=&quot;width: 1025px; height: 577px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_05.jpg&quot; style=&quot;width: 1025px; height: 1281px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_08.jpg&quot; style=&quot;width: 1025px; height: 1367px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_10.jpg&quot; style=&quot;width: 1025px; height: 1367px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_01.jpg&quot; style=&quot;width: 1025px; height: 682px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_02.jpg&quot; style=&quot;width: 1025px; height: 682px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_03.jpg&quot; style=&quot;width: 1025px; height: 682px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_04.jpg&quot; style=&quot;width: 1025px; height: 683px;&quot; /&gt;&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_13.jpg&quot; style=&quot;width: 1025px; height: 708px;&quot; /&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/botswana/Web_06.jpg&quot; style=&quot;width: 1025px; height: 683px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n'),(28,1,'&lt;p align=&quot;center&quot;&gt;The young hearts at the Talent Office decided to rebel against the all black everything attire and flaunted their multi- coloured sneakers paired, of course, with Fashion Club!&lt;br /&gt;\r\n&lt;br /&gt;\r\nYou know I’m ecstatic to FINALLY get a mini shoot with some of the core people behind Fashion Club because they wear the brand literally EVERYDAY but they’re always too busy to steal away to photograph!&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;I adore how they used their creative minds to find such a scenic location and who knew, it’s been above our office the whole time!&lt;br /&gt;\r\n&lt;br /&gt;\r\nCheck out their styling ideas below&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4683.JPG&quot; style=&quot;width: 800px; height: 800px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Simon, our graphic designer, wears our &lt;strong&gt;basic T-Shirt&lt;/strong&gt;&lt;br /&gt;\r\nMaureen, our Brand Manager, wears our&lt;strong&gt; Golden Ring Choker&lt;/strong&gt;&lt;br /&gt;\r\nAdilya, wears our&lt;strong&gt; Funhouse Mesh Jumper&lt;/strong&gt;&lt;br /&gt;\r\nGabby, our fashion crew members, wears our&lt;strong&gt; Golden Ring Choker&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4689.JPG&quot; style=&quot;width: 800px; height: 600px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Adilya, wears our&lt;strong&gt; Unisex Box Cut Tee&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4688.JPG&quot; style=&quot;width: 800px; height: 600px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Pedram, our Senior Designer wears our &lt;strong&gt;Oversized Mern\'s Shirt&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4686.JPG&quot; style=&quot;width: 800px; height: 601px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Moreblessing, Talent Development Manager from Zimbabwe, wears the &lt;strong&gt;Funhouse Jumper&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4685.JPG&quot; style=&quot;width: 800px; height: 600px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;Adilya killing our&lt;strong&gt; Funhouse Mesh Sleeved Sweater&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;img alt=&quot;&quot; src=&quot;https://fashionclub.my/image/data/kats blog/IMG_4687.JPG&quot; style=&quot;width: 800px; height: 600px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;I love everything about this photo!&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n');
/*!40000 ALTER TABLE `oc_simple_blog_article_description_additional` ENABLE KEYS */;
UNLOCK TABLES;

